504=>["Value"=>504,"TextKey"=>"宝箱TIPS信息100","TextValue"=>"افتح صندوق الكنز لتحصل بشكل عشوائي على: <br> جرم سماوي متقدم <br> قشر جوز الهند <br> عصير ليمون <br> دجاج مشوي لذيذ <br> كعك مختلف الألوان <br> محار <br> نوتة موسيقية <br> قيتارة حصان البحر <br> عصير جوز الهند اللذيذ <br> نقود <br> برعم وامض"],
505=>["Value"=>505,"TextKey"=>"金块资源弹窗描述","TextValue"=>"<line-height=135%> كيفية الحصول:<br>1. بعد الفوز في المرحلة اختر من المكافآت <br> 2. في بالشراء <color=#f58c26>متجر المنزل</color> <br>3. قم ببناء <color=#f58c26>خزينة</color> واحصل على الفوائد <br> استخدام: <br> 1. في <color=#f58c26> المنزل </color> اشتر أفراد القبيلة <br> 2. في <color=#f58c26> المنزل </color> قم ببناء الغرف إلخ <br>"],
506=>["Value"=>506,"TextKey"=>"原石资源弹窗描述","TextValue"=>"<line-height=135%> كيفية الحصول:<br> 1. من الكرمة المضيئة احصل على تجميعة سحرية <br> 2. قم بالشراء من متجر المنزل <br> 3. بناء <color=#f58c26> مخزن الخام </color> لحفظ المزيد من الخام <br>الطريقة: <br> 1. بناء <color=#f58c26> غرفة طويلة </color><br> 2. بناء <color=#f58c26> حقيبة النقود </color> مع <color=#f58c26> مخزن الخام </color>"],
