2642=>["Value"=>2642,"TextKey"=>"道具描述1701","TextValue"=>"طوطم زهرة الروح. قم بالدمج للحصول على <color=#df66a8>أطفال زهرة الروح</color>."],
2643=>["Value"=>2643,"TextKey"=>"道具描述1706","TextValue"=>"طوطم زهرة الروح عالي المستوى. قم بالدمج للحصول على <color=#df66a8>سيدة الزهور</color>."],
2644=>["Value"=>2644,"TextKey"=>"道具描述1801","TextValue"=>"طوطم العملاق. قم بالدمج للحصول على <color=#df66a8>المسخ الطفل</color>."],
2645=>["Value"=>2645,"TextKey"=>"道具描述1806","TextValue"=>"طوطم المسخ العملاق. قم بالدمج للحصول على <color=#df66a8>العملاق المسخ القوي</color>."],
2646=>["Value"=>2646,"TextKey"=>"道具描述1901","TextValue"=>"Totem of Chicks. Merge to get a <color=#df66a8>Hatched Chick</color>."],
2647=>["Value"=>2647,"TextKey"=>"道具描述1906","TextValue"=>"Totem of Birdies. Merge to get a <color=#df66a8>Apprentice Birdie</color>."],
2648=>["Value"=>2648,"TextKey"=>"道具描述2001","TextValue"=>"طوطم رجل الحجارة. قم بالدمج للحصول على <color=#df66a8>مولود روح الحجارة</color>."],
2649=>["Value"=>2649,"TextKey"=>"道具描述2006","TextValue"=>"طوطم رجل الحجارة عالي المستوى. قم بالدمج للحصول على <color=#df66a8>صخور الغابة العملاقة</color>."],
2650=>["Value"=>2650,"TextKey"=>"道具描述2101","TextValue"=>"Totem of Snails. Merge to get a <color=#df66a8>Watermelon Snail</color>."],
2651=>["Value"=>2651,"TextKey"=>"道具描述2106","TextValue"=>"Totem of Supersnails. Merge to get a <color=#df66a8>Grape Snail</color>."],
2652=>["Value"=>2652,"TextKey"=>"道具描述2201","TextValue"=>"القبيلة تعبد التنين العظيم! قم بالدمج للحصول على <color=#df66a8>السحلية ذات الرأس الكبير</color>."],
2653=>["Value"=>2653,"TextKey"=>"道具描述2206","TextValue"=>"آتي من الماضي البعيد. قم بالدمج للحصول على <color=#df66a8>تنين النار</color>."],
2654=>["Value"=>2654,"TextKey"=>"道具描述2301","TextValue"=>" يريد دائمًا أحد ترويض السميلودون. قم بالدمج للحصول على <color=#df66a8>شبل آكل اللحوم</color>"],
2655=>["Value"=>2655,"TextKey"=>"道具描述2306","TextValue"=>"يظهر أنيابه الحاده. قم بالدمج للحصول على <color=#df66a8>السميلودون السريع</color>."],
2656=>["Value"=>2656,"TextKey"=>"道具描述18601","TextValue"=>"تعليمات آله الخلق"],
2657=>["Value"=>2657,"TextKey"=>"道具描述18701","TextValue"=>"A new life just emerged from underground. Merge for an upgrade to get <color=#38c0a5>Bamboos</color>."],
2658=>["Value"=>2658,"TextKey"=>"道具描述18702","TextValue"=>"ينمو ببطء."],
2659=>["Value"=>2659,"TextKey"=>"道具描述18703","TextValue"=>"يبدو مختلفًا عن باقي الناس، لكنه لطيف."],
2660=>["Value"=>2660,"TextKey"=>"道具描述18704","TextValue"=>"It grew up too! Merge for an upgrade to get <color=#38c0a5>Bamboos</color>."],
2661=>["Value"=>2661,"TextKey"=>"道具描述18705","TextValue"=>"It's even stronger than it looks! Merge for an upgrade to get <color=#38c0a5>Bamboos</color>."],
2662=>["Value"=>2662,"TextKey"=>"道具描述18706","TextValue"=>"Can a panda win these bamboos in a fight? Merge for an upgrade to get <color=#38c0a5>Bamboos</color>."],
2663=>["Value"=>2663,"TextKey"=>"道具描述18707","TextValue"=>"Even thicker than a panda's waist! Merge for an upgrade to get <color=#38c0a5>Bamboos</color>."],
2664=>["Value"=>2664,"TextKey"=>"道具描述18708","TextValue"=>"لا أعرف هل فكروا أنهم سيكبرون ليصبحوا بهذا الحجم أم لا."],
2665=>["Value"=>2665,"TextKey"=>"道具描述18709","TextValue"=>"ستضل الطريق في هذه الغابات!"],
2666=>["Value"=>2666,"TextKey"=>"道具描述18710","TextValue"=>"زاوية جميلة وهادئة."],
2667=>["Value"=>2667,"TextKey"=>"道具描述18711","TextValue"=>"لا يسعك إلا أن تنهد بجمال الطبيعة والحياة."],
2668=>["Value"=>2668,"TextKey"=>"道具描述18801","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. الحظ السعيد بدون جذور!"],
2669=>["Value"=>2669,"TextKey"=>"道具描述18802","TextValue"=>"قم بالدمج للحصول على مستوي أعلى من زهرة اللوتس. إنها صغيرة للغاية!"],
2670=>["Value"=>2670,"TextKey"=>"道具描述18803","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. لقد آتت للتو لهذا العالم."],
2671=>["Value"=>2671,"TextKey"=>"道具描述18804","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. بتلاتها لها أطراف حمراء."],
2672=>["Value"=>2672,"TextKey"=>"道具描述18805","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. نقية كالملاك."],
2673=>["Value"=>2673,"TextKey"=>"道具描述18806","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. من النادر وجود مثل لونها هذا!"],
2674=>["Value"=>2674,"TextKey"=>"道具描述18807","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. لونها ساحر."],
2675=>["Value"=>2675,"TextKey"=>"道具描述18808","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. متباهية مثل الطاووس."],
2676=>["Value"=>2676,"TextKey"=>"道具描述18809","TextValue"=>"قم بالدمج للحصول على مستوى أعلى من زهرة اللوتس. تستيقظ في الليل فقط."],
2677=>["Value"=>2677,"TextKey"=>"道具描述18810","TextValue"=>"ليست زهرة منه هذا العالم."],
2678=>["Value"=>2678,"TextKey"=>"道具描述18901","TextValue"=>" اضغط للحصول على نقاط النشاط، أو استمر في الدمج. يمكن العزف مثل الطبل."],
2679=>["Value"=>2679,"TextKey"=>"道具描述18902","TextValue"=>" اضغط للحصول على نقاط النشاط، أو استمر في الدمج. طعمها حامض!"],
