8133=>["Value"=>8133,"TextKey"=>"新手引导说明2000","TextValue"=>"ساعدني أيها السامري الصالح! "],
8134=>["Value"=>8134,"TextKey"=>"新手引导说明2001","TextValue"=>"أنا مختوم بإحكام داخل هذه<color=#38c0a5> الطواطم</color>! "],
8135=>["Value"=>8135,"TextKey"=>"新手引导说明2002","TextValue"=>"اسحب أي<color=#38c0a5> طوطم</color> لجعل 3 من<color=#38c0a5> الطواطم</color> متجاورة سوياً وستندمج تلقائياً، ستتمكن حينها من إزالة الختم! "],
8136=>["Value"=>8136,"TextKey"=>"新手引导说明2010","TextValue"=>"أوه! ليس هناك<color=#38c0a5> طواطم</color> هنا."],
8137=>["Value"=>8137,"TextKey"=>"新手引导说明2011","TextValue"=>"انظر! إنها <color=#f58c26>شفرة الخالق</color>، يمكنك رؤيتها بكل مستوى، وستساعدك السجلات الموجودة بداخلها. "],
8138=>["Value"=>8138,"TextKey"=>"新手引导说明2012","TextValue"=>"اضغط أعلاها لرؤية تعليمات اللعبة، جربها! "],
8139=>["Value"=>8139,"TextKey"=>"新手引导说明2020","TextValue"=>"أنت بحاجة إلى الحصول على المواد المحددة وفقًا للمتطلبات إذا رغبت بالفور في المستوى. "],
8140=>["Value"=>8140,"TextKey"=>"新手引导说明2022","TextValue"=>"سيتم إظهار ما تحتاجه من مواد داخل هدف المستوى، ابدأ بالتركيب والفوز! "],
8141=>["Value"=>8141,"TextKey"=>"新手引导说明2030","TextValue"=>"أوه!<color=#ef933d> تماثيل الخالقات</color>! لقد تلاشت قواهم، يجب إيقاظها عبر الدمج! "],
8142=>["Value"=>8142,"TextKey"=>"新手引导说明2031","TextValue"=>"يمكنك احراز الفوز عبر دمجهن معاً بداحل المستويات التي تحتوى على <color=#ef933d>تماثيل الخالقات</color>. "],
8143=>["Value"=>8143,"TextKey"=>"新手引导说明2032","TextValue"=>"لقد فقدت هذه الأرض ارتباطها<color=#f58c26> بالخالقة</color> وسقطت في سبات عميق."],
8144=>["Value"=>8144,"TextKey"=>"新手引导说明2033","TextValue"=>"يتعذر تحريك أي شيء داخل<color=#38aec0> أرض النوم العميق</color>. "],
8145=>["Value"=>8145,"TextKey"=>"新手引导说明2034","TextValue"=>"ادمج أي<color=#38c0a5> زهرة أرواح</color> لإيقاظ الأرض. "],
8146=>["Value"=>8146,"TextKey"=>"新手引导说明2035","TextValue"=>"ستوقظ<color=#f58c26> الخالقة</color> جميع الأراضي التي تم لعنها من قبل الساحر بُعيد الفوز بالمستوى! "],
8147=>["Value"=>8147,"TextKey"=>"新手引导说明2040","TextValue"=>"انظر! إنه<color=#38c0a5> طوطم</color>! "],
8148=>["Value"=>8148,"TextKey"=>"新手引导说明2041","TextValue"=>"أسرع بدمج 3<color=#38c0a5> طواطم</color> لإنقاذ فرد العشيرة! "],
8149=>["Value"=>8149,"TextKey"=>"新手引导说明2050","TextValue"=>"كما قلنا للتو؛ اضغط على الجرم السماوي<color=#38c0a5> لروح الأرض</color> لإيقاظ الأرض. "],
8150=>["Value"=>8150,"TextKey"=>"新手引导说明2051","TextValue"=>"ويمكنك بالطبع الحصول على مستوى أعلى من الجرم السماوي<color=#38c0a5> لروح الأرض </color> عن طريق الدم. "],
8151=>["Value"=>8151,"TextKey"=>"新手引导说明2060","TextValue"=>"يمكنك دمج الدعائم المتشابهة العادية والمتواجدة لدى<color=#38aec0> أرض النوم العميق</color>، وستستيقظ<color=#38aec0> أرض النوم العميق</color> تلقائياً. "],
8152=>["Value"=>8152,"TextKey"=>"新手引导说明2070","TextValue"=>"اضغط على كومة <color=#38c0a5>الطواطم</color> لتحصل على '<color=#38c0a5>طوطم</color>'."],
8153=>["Value"=>8153,"TextKey"=>"新手引导说明2080","TextValue"=>"بعض <color=#38aec0>أراضي النوم العميق<color=#38aec0> لا يمكن إيقاظها من خلال <color=#38aec0>قيمة الشفاء</color>, يمكن إيقاظهم فقط عبر الدمج مع الدعائم المتواجدة على الأرض العادية.   "],
8154=>["Value"=>8154,"TextKey"=>"新手引导说明2090","TextValue"=>"المستوى به مهمة من الآن فصاعداً. "],
8155=>["Value"=>8155,"TextKey"=>"新手引导说明2091","TextValue"=>"يمكنك الضغط على شمس المهمة لعرض المحتوى والمكافآت. "],
8156=>["Value"=>8156,"TextKey"=>"新手引导说明2093","TextValue"=>"يقوم هذا المفتاح بتأمين أو إلغاء قفل شاشة السحب. "],
8157=>["Value"=>8157,"TextKey"=>"新手引导说明2100","TextValue"=>"يتعذر دمج بعض الدعائم مباشرة, يمكنك النقر فوق <color=#ef933d>تمثال الوتد</color> لتغييرها إلى <color=#ef933d>وتد</color> ثم دمجها مرة أخرى. "],
8158=>["Value"=>8158,"TextKey"=>"新手引导说明2110","TextValue"=>"تحتاج إلى التحقق من هدف التخليص لهذا المستوى. "],
8159=>["Value"=>8159,"TextKey"=>"新手引导说明2130","TextValue"=>"يمكننا الحصول على <color=#38c0a5>بذور الشجيرة</color> من خلال جميع أنواع <color=#38c0a5>عظام التنين</color>. "],
8160=>["Value"=>8160,"TextKey"=>"新手引导说明2140","TextValue"=>"هذه <color=#ef933d>قنبلة إيقاظ ضخمة</color>، وإذا أيقظت الأرض المجاورة لها فسوف تستيقظ بنفسها. وعندما توقظ نفسها ستوقظ أيضًا مساحة واحدة من الأرض حولها. "],
8161=>["Value"=>8161,"TextKey"=>"新手引导说明2150","TextValue"=>"يمكن لأعضاء القبيلة جمع <color=#38c0a5>قطعة خام</color> من <color=#38c0a5>الكروم</color> الأكثر تقدمًا, يمكنك النقر للتجميع. "],
8162=>["Value"=>8162,"TextKey"=>"新手引导说明2160","TextValue"=>"هذا <color=#ef933d>قبور مكسورة</color>, إذا تم تركهم بمفردهم أو دمجهم فسيتحولون إلى موتى أحياء مروعين؛ ستحصل على دعائم <color=#ef933d>اليراعة</color> الضرورية لتجاوز هذا المستوى بعد قتلهم. "],
8163=>["Value"=>8163,"TextKey"=>"新手引导说明2170","TextValue"=>"ستستمر <color=#ef933d>أعشاش الجدران المهجورة</color> في إنتاج الموتى الأحياء يقظين كانوا أم لا, سيؤدي النقر فوقه إلى إنتاج موتى أحياء على الفور؛ ستحصل على الكثير من مكافآت قطعة الحجر خام بُعيد تدمير <color=#ef933d>عش الجدار المهجور</color>. "],
8164=>["Value"=>8164,"TextKey"=>"新手引导说明2180","TextValue"=>"<color=#38c0a5>هذه <color=#ef933d>مصفوفة طلسم درويد</color>, حظاً سعيداً! يمكنك استدعاء <color=#ef933d>عضو قبيلة</color> عشوائيًا من المخيم للمساعدة من خلال دمجهم. "],
8165=>["Value"=>8165,"TextKey"=>"新手引导说明2190","TextValue"=>"يمكن للأشياء المقدسة التي خلّفتها شجرة الخلق أن تولد <color=#38c0a5>الجرم السماوي لروح الأرض</color> تلقائيًا وتوقظ الأرض, وكلما ارتفع مستوى البقايا التي خلّفتها شجرة الخلق كلما زادت قدرة الشفاء. "],
8166=>["Value"=>8166,"TextKey"=>"新手引导说明2200","TextValue"=>"سيتواجد المزيد والمزيد من <color=#ef933d>السحب البرّية</color> هنا, انقر فوقها لجعلها تمطر باستمرار. ستستمر الأرض الفارغة داخل منطقة المطر في إنتاج <color=#ef933d>أزهار الأرواح</color> و<color=#ef933d>المستنقعات</color>. "],
8167=>["Value"=>8167,"TextKey"=>"新手引导说明2210","TextValue"=>"هذا غريب, أين ذهب <color=#ef933d>تمثال الخالقة</color>؟ "],
8168=>["Value"=>8168,"TextKey"=>"新手引导说明2211","TextValue"=>"أوه صحيح, ستظهرن عند إتمامك المهمة! "],
8169=>["Value"=>8169,"TextKey"=>"新手引导说明2220","TextValue"=>"هذا هو <color=#ef933d>تمثال الشيطان</color> القبيح! مُر أفراد قبيلتك بتدميره وستحصل على <color=#ef933d>تمثال الخالقة</color>. "],
8170=>["Value"=>8170,"TextKey"=>"新手引导说明2230","TextValue"=>"تم افتتاح معسكر جديد, اذهب إلى <color=#f58c26>خريطة العالم</color> والقي نظرة"],
8171=>["Value"=>8171,"TextKey"=>"新手引导说明2240","TextValue"=>"أنا حرٌ مرةً أُخرى, شكراً. "],
8172=>["Value"=>8172,"TextKey"=>"新手引导说明2241","TextValue"=>"أعضاء عشيرتنا محتجزون داخل هذه <color=#38c0a5>الطواطم</color>. "],
8173=>["Value"=>8173,"TextKey"=>"新手引导说明2242","TextValue"=>"قبيلتنا بحاجة لانقاذك، ابحث عن الأعضاء المتحجزين الآخرين. "],
8174=>["Value"=>8174,"TextKey"=>"新手引导说明2243","TextValue"=>"ابحث عنهم بالمستوى التالي! "],
8175=>["Value"=>8175,"TextKey"=>"新手引导说明2250","TextValue"=>"يمكنك النقر نقرًا مزدوجًا فوق بعض المواد أو سحب الأعضاء إلى المواد لتجميعها. "],
8176=>["Value"=>8176,"TextKey"=>"新手引导说明2251","TextValue"=>"يمكن استخدام المواد التي تم جمعها أو دمجها بواسطتك. "],
8177=>["Value"=>8177,"TextKey"=>"新手引导说明2252","TextValue"=>"تجميع <color=#38c0a5>زهور الأرواح</color> سيمكنك من الحصول على <color=#38c0a5>روح الأرض</color>. "],
8178=>["Value"=>8178,"TextKey"=>"新手引导说明2253","TextValue"=>"اضغط على <color=#38c0a5>روح الأرض</color> لإيقاظ الأرض. "],
8179=>["Value"=>8179,"TextKey"=>"新手引导说明2261","TextValue"=>"سيمكنك اختيار المكافآت عند إتمام المستوى من الآن فصاعداً. "],
8180=>["Value"=>8180,"TextKey"=>"新手引导说明2262","TextValue"=>"المكافآت عادةً ما تكون عملات ذهبية وأشياء مفيدة أخرى، وأحياناً تكون <color=#38c0a5>طوطم</color>.   "],
8181=>["Value"=>8181,"TextKey"=>"新手引导说明2263","TextValue"=>"سيتم وضع مكافأتك في <color=#38aec0>فقاعة الأرض</color> وإعادتها إلى <color=#38aec0>منزلك</color>. "],
8182=>["Value"=>8182,"TextKey"=>"新手引导说明3000","TextValue"=>"هذا هو <color=#f58c26>منزلنا</color>. "],
8183=>["Value"=>8183,"TextKey"=>"新手引导说明3001","TextValue"=>"اعتادت قبيلتنا أن تسكن هنا لكن الفيضان دمر <color=#f58c26>موطننا</color> وغشى الضباب الأرض؛ واضطررنا إلى مغادرة مسقط رأسنا. "],
8184=>["Value"=>8184,"TextKey"=>"新手引导说明3002","TextValue"=>"يمكن أن يؤدي دمج الدعائم وأدوات <color=#38aec0>أرض النوم العميق</color> معاً إلى إيقاظ تلك الأرض مباشرة, حاول دمج ورفع الحظر عن أعضاء العشيرة وستتخلص من المزيد من الضباب. "],
8185=>["Value"=>8185,"TextKey"=>"新手引导说明3005","TextValue"=>"افتح <color=#38c0a5>صندوق كنز الوقت</color> لمرةٍ واحدةٍ على الأكثر وسيمكنك الحصول على مكافأة عند انتهاء العد التنازلي, كما يمكنك أيضًا إنفاق <color=#38c0a5>المجوهرات</color> لفتح أي <color=#38c0a5>صندوق كنز الوقت</color>. "],
8186=>["Value"=>8186,"TextKey"=>"新手引导说明3006","TextValue"=>"تم إرسال مكافأة المستوى هنا, افتح الفقاعة والقي نظرة. "],
8187=>["Value"=>8187,"TextKey"=>"新手引导说明3010","TextValue"=>"<color=#38c0a5>المنزل الطويل</color> هو مكان الراحة لأفراد القبيلة, ويمكن لأعضاء القبيلة التحرك مرة أخرى بعد القليل من الوقت.   "],
8188=>["Value"=>8188,"TextKey"=>"新手引导说明3011","TextValue"=>"يمكن دمج <color=#38c0a5>المنازل الطويلة</color> لتصبح منازل طويلة أكثر تطوراً, وكلما ارتفع مستوى المنازل الطويلة قل وقت الراحة المقابل. "],
8189=>["Value"=>8189,"TextKey"=>"新手引导说明3016","TextValue"=>"يمكن إنفاق <color=#38c0a5>المجوهرات</color> لإيقاظهم على الفور. "],
8190=>["Value"=>8190,"TextKey"=>"新手引导说明3030","TextValue"=>"يمكنك إتمام مهمة <color=#f58c26>المنزل</color> للحصول على المزيد من <color=#f58c26>تراث الأرض</color>, انقر فوق <color=#f58c26>تراث الأرض</color> للحصول على غنائم خاصة. "],
8191=>["Value"=>8191,"TextKey"=>"新手引导说明3040","TextValue"=>"هذا <color=#38c0a5>منجم ذهب</color> صغير. "],
8192=>["Value"=>8192,"TextKey"=>"新手引导说明3041","TextValue"=>"يمكنك النقر فوقها للحصول على موارد العملات الذهبية، كما يمكنك دمج <color=#38c0a5>مناجم ذهب</color> أكثر تقدمًا. "],
8193=>["Value"=>8193,"TextKey"=>"新手引导说明3042","TextValue"=>"يمكن إنفاق موارد <color=#38c0a5>منجم الذهب</color> <color=#38c0a5>بالمتجر</color>"],
8194=>["Value"=>8194,"TextKey"=>"新手引导说明3050","TextValue"=>"هل امتلأ <color=#38c0a5>منجم الذهب</color>؟ يمكنك الذهاب إلى <color=#38c0a5>المتجر</color> وشراء شيء جيد! "],
8195=>["Value"=>8195,"TextKey"=>"新手引导说明3060","TextValue"=>"جميع <color=#df66a8>أفراد القبيلة</color> مرهقون وبحاجة إلى الراحة لبعض الوقت. "],
8196=>["Value"=>8196,"TextKey"=>"新手引导说明3061","TextValue"=>"اسرع الآن لتحدي المزيد من المستويات وإنقاذ المزيد من أفراد العشيرة! "],
8197=>["Value"=>8197,"TextKey"=>"新手引导说明3062","TextValue"=>"كلما زاد عدد أفراد العشيرة لديك زادت الأشياء التي يمكنك جمعها قبل أن يأخذوا قسطاً من الراحة! "],
8198=>["Value"=>8198,"TextKey"=>"新手引导说明3063","TextValue"=>"يمكنك إنقاذ المزيد من أفراد العشيرة عبر الفوز بالمستوى, "],
8199=>["Value"=>8199,"TextKey"=>"新手引导说明3064","TextValue"=>"ثم يمكنك اصطحابهم إلى المنزل! "],
8200=>["Value"=>8200,"TextKey"=>"新手引导说明3065","TextValue"=>"انظر! يمكنك الانتقال إلى المستوى من هنا عبر <color=#f58c26>خريطة العالم</color>!   "],
8201=>["Value"=>8201,"TextKey"=>"新手引导说明3070","TextValue"=>"ليس هناك مكان! الأرضية مغطاة بالفعل! "],
8202=>["Value"=>8202,"TextKey"=>"新手引导说明3071","TextValue"=>"حدد أداة, ثم اختر بيعها أو إتلافها بمنطقة المعلومات. "],
8203=>["Value"=>8203,"TextKey"=>"新手引导说明3080","TextValue"=>"هذا <color=#38c0a5>تراث فضائي</color> نادر جدًا! انقر عليه للحصول على <color=#38c0a5>مجوهرات</color>, أو دمجه للحصول على مستوى أعلى من 'التراث الفضائي'. "],
8204=>["Value"=>8204,"TextKey"=>"新手引导说明3090","TextValue"=>"هذه قطعة من حطام <color=#38c0a5>الحجر الخام</color>. "],
8205=>["Value"=>8205,"TextKey"=>"新手引导说明3091","TextValue"=>"يمكنك النقر فوقها للحصول على موارد <color=#38c0a5>الخام</color>، كما يمكنك دمج قطع خام أكثر تقدمًا. "],
8206=>["Value"=>8206,"TextKey"=>"新手引导说明3092","TextValue"=>"يمكن إنفاق موارد <color=#38c0a5>الخام</color> بالمتجر</color>. "],
8207=>["Value"=>8207,"TextKey"=>"新手引导说明3100","TextValue"=>"إذا امتلأ <color=#38c0a5>الخام</color>؛ يمكنك شرائه من <color=#38c0a5>المتجر</color> وإنفاقه. "],
8208=>["Value"=>8208,"TextKey"=>"新手引导说明3110","TextValue"=>"هذا <color=#38c0a5>عائق طريق</color> بغيض, يتعذر التحرك طبيعياً. يمكنك أن تأمر <color=#38c0a5>أعضاء القبيلة</color> بالهجوم، أو انقر نقرًا مزدوجًا فوق <color=#38c0a5>عائق الطريق</color>. قد يتم إنشاء <color=#38c0a5>عوائق أصغر</color> على <color=#38c0a5>الطرق</color> بعد كسره.   "],
8209=>["Value"=>8209,"TextKey"=>"新手引导说明3120","TextValue"=>"يمكن <color=#38c0a5>للبطارية</color> غير المستهلكة مهاجمة الأرض المحيطة وتلويثها؛ يشير شريط التقدم إلى الفاصل الزمني لإطلاق النار. أيقظه لمهاجمته!   "],
8210=>["Value"=>8210,"TextKey"=>"新手引导说明3130","TextValue"=>"هذا <color=#f58c26>مذبح الأبطال</color>, سيقوم الأبطال بالتنقل بين وضع الراحة والدورية. "],
8211=>["Value"=>8211,"TextKey"=>"新手引导说明3131","TextValue"=>"ستكون هناك مفاجأة إضافية في أي 4 مجموعات عند تواجد البطل بالجوار! "],
8212=>["Value"=>8212,"TextKey"=>"新手引导说明3132","TextValue"=>"يمكنك إنفاق <color=#38c0a5>جوهرة</color> للاستيقاظ مباشرة إذا كنت في وضع الراحة. "],
8213=>["Value"=>8213,"TextKey"=>"新手引导说明3133","TextValue"=>"يمكنك النقر هنا لعرض المعلومات المتعلقة بالبطل "],
8214=>["Value"=>8214,"TextKey"=>"新手引导说明3142","TextValue"=>"يتمتع الأبطال بمهارات فريدة كوحدة قوة القبيلة. "],
8215=>["Value"=>8215,"TextKey"=>"新手引导说明3144","TextValue"=>"مهارات البطل؛ يمكنك عرض وصف مهارات البطل بهذه المنطقة. "],
8216=>["Value"=>8216,"TextKey"=>"新手引导说明3145","TextValue"=>"يمكنك تقديم مهمة لترقية مستوى البطل. "],
8217=>["Value"=>8217,"TextKey"=>"新手引导说明3147","TextValue"=>"أكمل جميع الطلبات لترقية البطل "],
8218=>["Value"=>8218,"TextKey"=>"新手引导说明3150","TextValue"=>"أحسنت صنعًا، لقد تخلص المزيد من أفراد العشيرة من الختم! "],
8219=>["Value"=>8219,"TextKey"=>"新手引导说明3151","TextValue"=>"كلما زاد عدد أفراد القبيلة, كلما انقشع المزيد من الضباب! "],
8220=>["Value"=>8220,"TextKey"=>"新手引导说明3152","TextValue"=>"يتطلب التخلص من الضباب بكل منطقة درجة محددة من <color=#f58c26>القوة القبلية</color>. "],
8221=>["Value"=>8221,"TextKey"=>"新手引导说明3153","TextValue"=>"يمكن الآن إبادة جزء من الضباب عن طريق النقر أعلاه. "],
8222=>["Value"=>8222,"TextKey"=>"新手引导说明3161","TextValue"=>"تعذر تبديد الضباب الحالي "],
8223=>["Value"=>8223,"TextKey"=>"新手引导说明3162","TextValue"=>"<color=#f58c26>قوتك القبلية</color> غير كافية, يمكنك الذهاب إلى <color=#f58c26>المتجر</color> لشراء المزيد من <color=#f58c26>الطواطم</color> "],
8224=>["Value"=>8224,"TextKey"=>"新手引导说明3165","TextValue"=>"يمكن إنفاق عملات ذهبية لشراء <color=#38c0a5>طوطم</color> "],
8225=>["Value"=>8225,"TextKey"=>"新手引导说明3166","TextValue"=>"سيرتفع السعر كلما ابتعت <color=#38c0a5>طوطم</color>, اجمع المزيد من العملات الذهبية "],
8226=>["Value"=>8226,"TextKey"=>"新手引导说明2270","TextValue"=>"هذا <color=#f58c26>مستوى مؤقت</color>, يجب إتمامه خلال الوقت المُحدد أو ستفشل"],
8227=>["Value"=>8227,"TextKey"=>"新手引导说明2271","TextValue"=>"يتم تسجيل الوقت المتبقي من المستوى في المنطقة التالية "],
8228=>["Value"=>8228,"TextKey"=>"新手引导说明2273","TextValue"=>"يتغير لون الرقم من <color=#46bb83>الأخضر</color> إلى <color=#eca852>الأصفر</color> و<color=#e04030>الأحمر</color> مع تقلص الوقت "],
8229=>["Value"=>8229,"TextKey"=>"新手引导说明2274","TextValue"=>"يمكنك إلقاء نظرة بالمتجر لتحسين كفاءة <color=#f58c26>التخليص الجمركي</color> "],
8230=>["Value"=>8230,"TextKey"=>"新手引导说明2277","TextValue"=>"يمكنك إنفاق <color=#38c0a5>المجوهرات</color> مباشرةً لشراء أدوات رئيسية من <color=#f58c26>المتجر</color> "],
8231=>["Value"=>8231,"TextKey"=>"新手引导说明2281","TextValue"=>"يمكنك الحصول على <color=#df66a8>أفراد القبيلة</color> كمكافأة على الانتصار بهذا المستوى، يمكنك إنفاق <color=#38c0a5>المجوهرات</color> لمضاعفة المكافأة "],
8232=>["Value"=>8232,"TextKey"=>"新手引导说明2290","TextValue"=>"مرحبًا بك في مستوى التحدي مرة أخرى، ستظل هناك مكافآت على هذا التخليص الجمركي "],
8233=>["Value"=>8233,"TextKey"=>"新手引导说明2291","TextValue"=>"يمكن إتمام كل مستوى تحدي <color=#f58c26>3 مرات</color>، ولكن سيتقلص الحد الزمني أكثر فأكثر"],
8234=>["Value"=>8234,"TextKey"=>"新手引导说明3149","TextValue"=>"تتطلب ترقية البطل وقت انتظار, يمكنك إنفاق <color=#38c0a5>مجوهرات</color> لتسريع الترقية "],
8235=>["Value"=>8235,"TextKey"=>"新手引导说明2300","TextValue"=>"انظر! هناك <color=#46bb83>فسيفساء</color> هنا, يمكنها التحكم في الضباب بمنطقة كبيرة "],
8236=>["Value"=>8236,"TextKey"=>"新手引导说明2301","TextValue"=>"اسحب الأداة المقابلة إلى المنطقة الآلية لفتحها "],
8237=>["Value"=>8237,"TextKey"=>"新手引导说明2302","TextValue"=>"يجب إيقاظ المنطقة الآلية أولاً ما إن كانت غارقة في سُبات عميق "],
8238=>["Value"=>8238,"TextKey"=>"新手引导说明2400","TextValue"=>"مرحبًا بكم في <color=#46bb83>مستوى الحدث</color>, وهو نوع من أسلوب اللعب المفتوح ذو الوقت المُحدد "],
8239=>["Value"=>8239,"TextKey"=>"新手引导说明2401","TextValue"=>"مكافأة <color=#46bb83>مستوى الحدث</color> ثمينة, وسيتم توزيعها على <color=#f58c26>المنزل</color> "],
8240=>["Value"=>8240,"TextKey"=>"新手引导说明2402","TextValue"=>"هناك أدوات وطرق لعب فريدة من نوعها ... "],
8241=>["Value"=>8241,"TextKey"=>"新手引导说明3180","TextValue"=>"<color=#f58c26>المصباح</color> هو مورد ضروري لدعم اللاعبين لتحدي المستوى, وسيتعافى ببطء مع مرور الوقت "],
8242=>["Value"=>8242,"TextKey"=>"新手引导说明3181","TextValue"=>"<color=#f58c26>مصباحك</color> الحاليّ مُمتليء, اذهب واستهلكه سريعاً! "],
8243=>["Value"=>8243,"TextKey"=>"新手引导说明1072","TextValue"=>"يمكنك عرض <color=#38c0a5>مكافآت المخيم</color> من الآن فصاعدًا"],
8244=>["Value"=>8244,"TextKey"=>"新手引导说明1073","TextValue"=>" يمكنك الحصول على صندوق الكنز عند انتهاء <color=#f58c26>وقت الانتظار</color> "],
8245=>["Value"=>8245,"TextKey"=>"新手引导说明1074","TextValue"=>"كلما زادت أعداد <color=#f58c26>النجوم</color> والمكافآت التي تحصل عليها في المستوى, ستكون المكافأة أكثر سخاءً "],
8246=>["Value"=>8246,"TextKey"=>"新手引导说明2235","TextValue"=>"انظر! إنه على <color=#f58c26>الخريطة</color>, اذهب لفتحه وتحقق منه! "],
8247=>["Value"=>8247,"TextKey"=>"新手引导说明2310","TextValue"=>"لقد وجد الكشافة <color=#d0603e>معسكرًا<color=#967357> جديدًا, اذهب وتفقده"],
8248=>["Value"=>8248,"TextKey"=>"新手引导说明2315","TextValue"=>"ربما يمكننا مقابلة بعض الأصدقاء الجدد المثيرين للاهتمام هنا! "],
8249=>["Value"=>8249,"TextKey"=>"新手引导说明2320","TextValue"=>"مرحبا بكم في <color=#46bb83>نشاط العطلة الثلجية</color>, العالم الرائع في انتظارك لاستكشافه! "],
