9044=>["Value"=>9044,"TextKey"=>"剧情ID1010101","TextValue"=>"صباح الخير زعيم القبيلة! أنا تريستان، مُستطلعك المخلص! كانت رحلة صعبة، لكننا نجونا جميعًا. كم هو رائع! لقد وجدنا الأرض أخيرًا, يمكننا الآن بناء <color=#f58c26>معسكر</color>. "],
9045=>["Value"=>9045,"TextKey"=>"剧情ID1010102","TextValue"=>"إنها خصبة حقاً! لا أعلم ماذا سنجد هنا؟ لننصب خيمة لحمايتنا من الرياح والمطر! "],
9046=>["Value"=>9046,"TextKey"=>"剧情ID1010201","TextValue"=>"يا إلهي, ما هذا ... هذه الأرض القاحلة القبيحة ... وتلك الخيمة القبيحة أيضاً! أريد العودة إلى المنزل ..."],
9047=>["Value"=>9047,"TextKey"=>"剧情ID1010202","TextValue"=>"إيندا، أعلم أنه ليس من السهل عليك مغادرة المنزل، لكن ليس هناك طريقة أخرى. تلك الكوارث الطبيعية غريبة جدا ... علينا أن نجد تفسيراً! لهذا السبب نطلب المساعدة. "],
9048=>["Value"=>9048,"TextKey"=>"剧情ID1010203","TextValue"=>"لكننا سنجد طريق العودة إلى المنزل, صحيح؟ لنبني لك <color=#f58c26>مذبح</color> أولاً لتتحدث مع الإله, ما رأيك بالكاهن إندا؟ سيساعدنا زعيم القبيلة! "],
9049=>["Value"=>9049,"TextKey"=>"剧情ID1020101","TextValue"=>"انظر ماذا وجدنا! <color=#ef933d>تراث الأرض</color>! لدينا ما نحتاجه من المواد لبناء <color=#f58c26>المذبح</color>, كما وجدنا طريقة لحلّ ختم الطوطم! إنها أرض غنية! "],
9050=>["Value"=>9050,"TextKey"=>"剧情ID1020201","TextValue"=>"أعتقد أنك لست فاشلاً تمامًا ... ماذا تُدعى .. ـستان. على الرغم من أن هذا المذبح أصغر كثيراً من المذبح الموجود في موطني وليس مُذهلاً، إلا أنه كافٍ للآن. الآن، ابتعد عن الطريق! "],
9051=>["Value"=>9051,"TextKey"=>"剧情ID1020202","TextValue"=>"آه ..، لطيفة جدًا, أنظر كم هي سعيدة! وطريقتها الملتوية في الشكر! "],
9052=>["Value"=>9052,"TextKey"=>"剧情ID1020203","TextValue"=>"(رقصة غريبة) قال لي إلهنا أننا بالمكان الصحيح، وبعد ذلك سنلتقي برجل نبيل ... "],
9053=>["Value"=>9053,"TextKey"=>"剧情ID1020204","TextValue"=>"حقاً؟ هذا رائع! متى سنلتقي بهذا الرجل النبيل؟ "],
9054=>["Value"=>9054,"TextKey"=>"剧情ID1020301","TextValue"=>"هل أنتم من أيقظني من نومي يا رفاق؟! "],
9055=>["Value"=>9055,"TextKey"=>"剧情ID1020302","TextValue"=>"... أنت؟ "],
9056=>["Value"=>9056,"TextKey"=>"剧情ID1020303","TextValue"=>"أنا الكاهن العظيم, سلف أمير الشعراء .. قاهر العاصفة .. القديس الراعي للمغامرين .. الجلاد ورسول الإله، أميجين المُغني! "],
9057=>["Value"=>9057,"TextKey"=>"剧情ID1020304","TextValue"=>"أوه ... سعيد بمعرفتك, ربما؟ نحن جدد هنا, وسمعنا أن ..."],
9058=>["Value"=>9058,"TextKey"=>"剧情ID1020305","TextValue"=>"ماذا؟! هل أنتم غزاة أجانب؟! لن أعطيكم الفرصة لتدمير منازلكم وعائلاتكم! "],
9059=>["Value"=>9059,"TextKey"=>"剧情ID1020401","TextValue"=>"ماذا؟ لا, كلا! نحن لسنا غُزاة! نحن نبحث عن مكان لنرتاح فيه, ونحل لغز منزلنا أيضاً ..."],
9060=>["Value"=>9060,"TextKey"=>"剧情ID1020402","TextValue"=>"لا! الجسر! انظر إلى ما فعلت! سيغضب الإله! انتظر ... من قلت أنت؟ أميجين؟ الكاهن الكبير أميجين؟ الأسطوري؟ "],
9061=>["Value"=>9061,"TextKey"=>"剧情ID1020403","TextValue"=>"أنتم ... لستم غُزاة؟ إذاً من أنتم؟ ماذا تفعلون هنا؟ ما هذا المكان؟ ماذا عن شعبي؟ ليس لدي انطباع عن هذا المكان ..."],
9062=>["Value"=>9062,"TextKey"=>"剧情ID1020404","TextValue"=>"أعتذر، لكن لا يمكننا الإجابة عن أسئلتك, نحن نخاطر بحياتنا بمجيئنا إلى هنا ونبحث عن خبراء بإمكانهم مساعدتنا في حل لغز وطننا؛ لقد غلف ضباب كثيف موطننا، ومن ثم ..."],
9063=>["Value"=>9063,"TextKey"=>"剧情ID1020405","TextValue"=>"كانت هناك فيضانات العام الماضي أكثر مما كانت عليه في العقد الماضي, لكن أغرب شيء هو أن أفراد عشيرتنا أصبحوا طواطم هامدة! هل تصدق ذلك؟! "],
9064=>["Value"=>9064,"TextKey"=>"剧情ID1020406","TextValue"=>"أوه ... الكثير من المعلومات, أعتذر كوني كنت متهورًا جدًا في تدمير جسركم, ربما يمكنني مساعدتكم في إعادة بنائه؟ "],
9065=>["Value"=>9065,"TextKey"=>"剧情ID1020407","TextValue"=>"أميجين؟! أميجين العظيم؟! ردائك, لديك القدرة على استدعاء الريح والمطر ... أنت حقيقي! هذا يعني أن جميع الأساطير في عشيرتي صحيحة! "],
9066=>["Value"=>9066,"TextKey"=>"剧情ID1020408","TextValue"=>"أيها العمال, تمالكوا أنفسكم وأعيدوا بناء هذا الجسر! "],
9067=>["Value"=>9067,"TextKey"=>"剧情ID1020409","TextValue"=>"لكننا أُصبنا! لا يمكننا العمل الآن! "],
9068=>["Value"=>9068,"TextKey"=>"剧情ID1020410","TextValue"=>"أعلم ما تحتاجونه, لقد تعلمت الكثير عن طب الأعشاب في رحلتي الطويلة. لنجمع بعض الأعشاب ونبني هنا <color=#f58c26>حديقة أعشاب</color> بمثابة اعتذار لكم. "],
9069=>["Value"=>9069,"TextKey"=>"剧情ID1020411","TextValue"=>"شكراً! هذا لطف منك, سنستخدم معرفتنا الجديدة للعودة إلى الوطن وإنقاذ الأشخاص المحاصرين داخل الطوطم! حسناً, هيا بنا! "],
9070=>["Value"=>9070,"TextKey"=>"剧情ID1030101","TextValue"=>"لقد عدنا, كما أحضرنا خبيراً جديدا! ليقوم ببناء <color=#f58c26>حديقة عشب صغيرة</color>!"],
9071=>["Value"=>9071,"TextKey"=>"剧情ID1030201","TextValue"=>"واو، على الاعتراف أن تقنية البناء لديك جيدة حقًا! هذه الحديقة الصغيرة جميلة للغاية. "],
9072=>["Value"=>9072,"TextKey"=>"剧情ID1030202","TextValue"=>"كما أنها ناجحة! الآن وقد تم علاج إصابات العمال؛ يمكننا إعادة بناء الجسر! "],
9073=>["Value"=>9073,"TextKey"=>"剧情ID1030203","TextValue"=>"يُسعدني مساعدتك. "],
9074=>["Value"=>9074,"TextKey"=>"剧情ID1030204","TextValue"=>"كان الكاهن يمدح فضيلتك وسعة اطلاعك, ما قصدت قوله هو ..."],
9075=>["Value"=>9075,"TextKey"=>"剧情ID1030205","TextValue"=>"إنه لشرف عظيم أن ينضم إلينا مغامر متمرس مثلك, لكنك أسطورة! لا يمكنك الذهاب مع بعض الغرباء الغريبين! أيمكنك ذلك؟ اذهب معنا رجاءً!   "],
9076=>["Value"=>9076,"TextKey"=>"剧情ID1030206","TextValue"=>"حسناً, ربما لهذا السبب تم إرسالي إلى هنا. "],
9077=>["Value"=>9077,"TextKey"=>"剧情ID1030207","TextValue"=>"كنت أعلم أنك لن تـ ... ماذا! هل ستأتي معنا؟! يا إلهي لا أصدق ذلك ... اليوم هو أفضل يوم في حياتي! "],
9078=>["Value"=>9078,"TextKey"=>"剧情ID1030208","TextValue"=>"عذراً، تصبح متحمسة للغاية في بعض الأحيان, الآن بعد أن انضممت إلى فريقنا لم لا نقيم لك حفل ترحيب لك؟ "],
9079=>["Value"=>9079,"TextKey"=>"剧情ID1030209","TextValue"=>"كلا, لا أريد حفلاً. الآن لدي أشياء أكثر إلحاحًا لفعلها, سأحضر بعض الخشب وأعيد بناء الجسر الذي دمرته. "],
9080=>["Value"=>9080,"TextKey"=>"剧情ID1030210","TextValue"=>"يا له من رجل نبيل! أوه! مجرد التمكن من مقابلته ... هذا أفضل يوم في حياتي! "],
9081=>["Value"=>9081,"TextKey"=>"剧情ID1040101","TextValue"=>"أنت ... زعيم القبيلة، أليس كذلك؟ لقد ساعدتني كثيراً, شكراً لك. نحن الآن جاهزون لبناء الجسر. "],
9082=>["Value"=>9082,"TextKey"=>"剧情ID1040201","TextValue"=>"كالجديد تماماً! الآن؛ الكاهن إندا، هل أنت مستعد للتحدث مع الإله مرة أخرى؟  "],
9083=>["Value"=>9083,"TextKey"=>"剧情ID1040202","TextValue"=>"لم أكن أكثر استعداداً من قبل! "],
9084=>["Value"=>9084,"TextKey"=>"剧情ID1040301","TextValue"=>"حسناً يا زعيم القبيلة, ها قد اجتمعت الكاهنة بمذبحها الحبيب, فلنفعل شيئاً آخر ..."],
9085=>["Value"=>9085,"TextKey"=>"剧情ID1040401","TextValue"=>"آه فيما تعثرت؟ ها، لقد سقط <color=#38c0a5>حجراً خاماً</color> من <color=#f58c26>المذبح</color>, أنتم مهملون في عملكم يا رفاق. "],
9086=>["Value"=>9086,"TextKey"=>"剧情ID1040402","TextValue"=>"آه فهمت! نحتاج إلى بناء <color=#f58c26>مستودع</color> لتخزين جميع أنواع الموارد الطبيعية, هكذا لن يتعثر الناس في جميع الأشياء المنتشرة على الأرض. "],
9087=>["Value"=>9087,"TextKey"=>"剧情ID1050101","TextValue"=>"هل كل شيء جاهز؟ لنحتفل! عذراً, أعني لنبني <color=#f58c26>مستودع</color>. "],
9088=>["Value"=>9088,"TextKey"=>"剧情ID1050201","TextValue"=>"جدران صلبة ومساحة داخلية واسعة ومشرقة ... تتحسن مهارات زعيم القبيلة في البناء يومًا بعد يوم! "],
9089=>["Value"=>9089,"TextKey"=>"剧情ID1050202","TextValue"=>"أوه سيدي؟ هناك شيء ذو ثماني أرجل خلفك. "],
9090=>["Value"=>9090,"TextKey"=>"剧情ID1050301","TextValue"=>"ماذا؟! كيف ذلك؟! ما هذا؟ يبدو كجيفة حيوان مائيّ ... امم، جلده ناعم ومرن. "],
9091=>["Value"=>9091,"TextKey"=>"剧情ID1050302","TextValue"=>"<color=#f58c26>شيطان بحر الشمال العظيم</color>! إنه <color=#f58c26>شيطان بحر الشمال العظيم</color>!! لقد قرأت في الكتب أنه أحد أشبال الوحوش! لماذا يتواجد <color=#f58c26>شيطان بحر الشمال العظيم</color> هنا؟ "],
9092=>["Value"=>9092,"TextKey"=>"剧情ID1050303","TextValue"=>"لا تخف, أولاً، إنه ميت. ثانيًا، إنه مجرد <color=#f58c26>أخطبوط</color>. "],
9093=>["Value"=>9093,"TextKey"=>"剧情ID1050304","TextValue"=>"أخطبوط؟ لم أسمع به من قبل ..."],
9094=>["Value"=>9094,"TextKey"=>"剧情ID1050305","TextValue"=>"لا بد أنكم من البرّ, يعمل قومي بالبحارة ونحيا بجانب البحر, الأخطبوط شائع عندنا كالنجوم في سماء الليل. "],
9095=>["Value"=>9095,"TextKey"=>"剧情ID1050306","TextValue"=>"في الواقع .. تعالو معي, دعونا نجد بعض الحبال والفروع, لنرى كيف يمكننا صنع خيمة من جلد الأخطبوط. "],
9096=>["Value"=>9096,"TextKey"=>"剧情ID1060101","TextValue"=>"... ومن ثم ... تم ذلك. لا أعتقد أنه قبيح لهذه الدرجة. "],
9097=>["Value"=>9097,"TextKey"=>"剧情ID1060102","TextValue"=>"إنه ... حقاً ... لطيف. "],
9098=>["Value"=>9098,"TextKey"=>"剧情ID1060103","TextValue"=>"آسف, أنا أفضل بكثير في الناحية النظرية من الممارسة, البناء ... ليس شيئاً أجيده. الآن ... قد أحتاج إلى الاستلقاء لفترة من الوقت ..."],
9099=>["Value"=>9099,"TextKey"=>"剧情ID1060104","TextValue"=>"أوه، أميجين العظيم! لمَ لا تتبعني إلى خيمتنا الرئيسية للراحة؟ لقد علمتني حكمتك، وسأكون دائمًا خادمك المخلص ..."],
9100=>["Value"=>9100,"TextKey"=>"剧情ID1060201","TextValue"=>"إنه كحلم يتحقق للكاهن, أنا سعيد كونه تربطهما علاقة جيدة. لكن هناك شيء خاطئ، أليس كذلك يا زعيم القبيلة؟ "],
9101=>["Value"=>9101,"TextKey"=>"剧情ID1060202","TextValue"=>"قال شيوخ القبيلة جميعًا أنه لم يعد أيًا من الأشخاص الذين ذهبوا للبحث عن البحر المزعوم, أوه، عدا الشخص الذي أصبح مجنونًا بعد عودته؛ كان يتحدث عن جدار عالٍ مصنوع من الماء في نهاية العالم. "],
9102=>["Value"=>9102,"TextKey"=>"剧情ID1060203","TextValue"=>"لكن أمجين قال أنهم قوم البحر! لا أحد يعيش في البحر! "],
9103=>["Value"=>9103,"TextKey"=>"剧情ID1060204","TextValue"=>"لهذا السبب هناك شيء خاطئ, لكنه لم يؤذينا حتى الآن, دعونا نتركه وشأنه وننهي عملنا. "],
9104=>["Value"=>9104,"TextKey"=>"剧情ID1060205","TextValue"=>"لقد استكشفت مساحة كبيرة الآن، ولدينا الكثير من الغنائم لملء المخيم. يمكن للماشية مساعدتنا في إعادتهم إلى الديار, يجب أن نبني <color=#f58c26>حظيرة</color> لهم من أجل راحتهم. "],
9105=>["Value"=>9105,"TextKey"=>"剧情ID1070101","TextValue"=>"يبدو رائعاً يا زعيم القبيلة! يبدو أن هؤلاء الصغار سيكونون في متناول اليد قريبًا. مذهل! "],
9106=>["Value"=>9106,"TextKey"=>"剧情ID1070102","TextValue"=>"قاربت أعمال البناء لدينا على الانتهاء، ولكن لا يزال لدي شيء بحاجة لمساعدتك. "],
9107=>["Value"=>9107,"TextKey"=>"剧情ID1070103","TextValue"=>"نحن بحاجة إلى فريق استكشافي محترف للقيام بدوريات في حالة وجود مؤامرة لتدمير ثمار عملنا بعد مغادرتنا المخيم. "],
9108=>["Value"=>9108,"TextKey"=>"剧情ID1070104","TextValue"=>"نحن بحاجة لبناء <color=#f58c26>ساحة تدريب</color> لهم! "],
9109=>["Value"=>9109,"TextKey"=>"剧情ID1070105","TextValue"=>"هذا صحيح كيفين, <color=#f58c26>ساحة تدريب</color>! لنبحث عن المواد! "],
9110=>["Value"=>9110,"TextKey"=>"剧情ID1080101","TextValue"=>"مستعد؟ "],
9111=>["Value"=>9111,"TextKey"=>"剧情ID1080102","TextValue"=>"مستعد يا سيدي! "],
9112=>["Value"=>9112,"TextKey"=>"剧情ID1080103","TextValue"=>"لقد أعد زعيم القبيلة المواد بالفعل، فلنبدأ! "],
9113=>["Value"=>9113,"TextKey"=>"剧情ID1080104","TextValue"=>"حسناً سيدي, لا بأس! "],
9114=>["Value"=>9114,"TextKey"=>"剧情ID1080201","TextValue"=>"أحسنت صُنعاً! والآن نحن سـ ... كاهنتي؟ ما الأمر؟ "],
9115=>["Value"=>9115,"TextKey"=>"剧情ID1080301","TextValue"=>"كنت أتحدث للتو إلى الكاهن أميجين, ثم غلبنا النعاس جميعاً لأننا كنا متعبين للغاية وراودنا نفس الحلم، حيث قالت لنا إلهة "احموا <color=#f58c26>قلب البحر</color> ..." "],
9116=>["Value"=>9116,"TextKey"=>"剧情ID1080302","TextValue"=>"<color=#f58c26>قلب البحر</color>؟ ما هذا؟ "],
9117=>["Value"=>9117,"TextKey"=>"剧情ID1080303","TextValue"=>"لدى قومي أسطورة مفادها أن هناك فقاعة ضخمة في أعماق البحار تحميها أصغر الآلهة. لم تنجو الحيوانات القديمة داخل الفقاعة فحسب، بل نجت أيضًا العمالقة والجان. لكنها قصة قبل النوم للأطفال فقط. "],
9118=>["Value"=>9118,"TextKey"=>"剧情ID1080304","TextValue"=>"لا بد لي من دراسة هذا الأمر, أحتاج إلى <color=#f58c26>قاعدة رونية قوية</color> لسماع رسالة الإلهة بشكل أكثر وضوحًا. "],
9119=>["Value"=>9119,"TextKey"=>"剧情ID1080305","TextValue"=>"تلقيت ذلك! حسناً يا زعيم القبيلة, فلنعثر على بعض الأحجار ونبني قاعدة لإندا! "],
9120=>["Value"=>9120,"TextKey"=>"剧情ID1090101","TextValue"=>"فلننهي الأمر, حان وقت الاحتفال! "],
9121=>["Value"=>9121,"TextKey"=>"剧情ID1090102","TextValue"=>"جيد! "],
9122=>["Value"=>9122,"TextKey"=>"剧情ID1090201","TextValue"=>"لا تحتفلوا بعد! لا أستطيع التركيز عندما تصبحون صاخبين! "],
9123=>["Value"=>9123,"TextKey"=>"剧情ID1090202","TextValue"=>"أحاول التواصل مع الإله وأنتم تزعجونني يا أطفال! "],
9124=>["Value"=>9124,"TextKey"=>"剧情ID1090203","TextValue"=>"اصمتوا ودعوني أعمل! "],
9125=>["Value"=>9125,"TextKey"=>"剧情ID1090204","TextValue"=>"رباه, أحدهم في مزاج سيء. "],
9126=>["Value"=>9126,"TextKey"=>"剧情ID1090205","TextValue"=>"انتظروا! اهدئوا! أعتقد أنني أستطيع سماع صوتها, هذا الأمر مهم جداً. "],
9127=>["Value"=>9127,"TextKey"=>"剧情ID1090206","TextValue"=>"امم ... لا أستطيع السماع بوضوح ... لكن أعتقد أنها تقول أن علينا السير شمالًا, ليس هناك طيور وحيوانات أو عشب أيضًا, يمكننا العثور هناك على صديق. "],
9128=>["Value"=>9128,"TextKey"=>"剧情ID1090207","TextValue"=>"حسنًا، يبدو هذا ... مستحيلًا؟ أعني، ماذا يمكن أن يحدث؟ فلنذهب شمالاً! "],
9129=>["Value"=>9129,"TextKey"=>"剧情ID1090208","TextValue"=>"لكن يمكننا الاحتفال أخيرًا باستكمال معسكرنا الجديد قبل ذلك! تعالوا جميعاً, سنقيم حفلاً كبيراً! "],
9130=>["Value"=>9130,"TextKey"=>"剧情ID1090209","TextValue"=>"مرحى! "],
9131=>["Value"=>9131,"TextKey"=>"剧情ID1090301","TextValue"=>"اعتقدنا أننا قد لا نعود أبدًا عندما غادرنا المنزل, لكننا وجدنا هذه الجزيرة الرائعة وأقمنا صداقات جديدة، حتى أننا وجدنا طريقة لإحياء أفراد القبيلة الذين اعتقدنا أنهم رحلوا! "],
9132=>["Value"=>9132,"TextKey"=>"剧情ID1090302","TextValue"=>"علينا شكر إلهتنا على كل هذا؛ لقد كانت تحمينا وترشدنا, ثم أود أن أشكر صديقنا الجديد، عزيزي أميجين، الذي كان نقل إلينا معرفته العميقة بتفانٍ. "],
9133=>["Value"=>9133,"TextKey"=>"剧情ID1090303","TextValue"=>"لكن الأهم من ذلك كله هو زعيم القبيلة, إن لم تكن قويًا وودودًا كما كنت من قبل فلن نكن لنتمكن من القيام بأي شيء. لذا، شكراً لك على كل شيء. إيه ... كاهنة، أتبكين؟ "],
9134=>["Value"=>9134,"TextKey"=>"剧情ID1090304","TextValue"=>"أنا ... لم ... *تتمخط* لم أبكي! إنه فقط ... * تتمخط* حسنًا، فعلت! أنا أبكي! هل أنتم راضون جميعاً الآن؟! أحبك يا زعيم القبيلة! أنت أفضل قائد! "],
9135=>["Value"=>9135,"TextKey"=>"剧情ID1090305","TextValue"=>"هاها، أعتقد أن هذا يكفي سيدي, لا أطيق الانتظار لرؤية كيف ستكون رحلتنا المستقبلية. يوماً ما سنحل لغز موطننا ونعيد بناءه. "],
9136=>["Value"=>9136,"TextKey"=>"剧情ID2010101","TextValue"=>"لا تقلقوا يا أولاد، سنكون هناك فوراً ..."],
9137=>["Value"=>9137,"TextKey"=>"剧情ID2010102","TextValue"=>"باركك الإله! كنا نسير في الصحراء منذ عدة أيام, هل يمكنك إعطائي بعض الماء؟ "],
9138=>["Value"=>9138,"TextKey"=>"剧情ID2010103","TextValue"=>"كن صبوراً! عندما كنت في عمرك ... ما هذا؟ "],
9139=>["Value"=>9139,"TextKey"=>"剧情ID2010201","TextValue"=>"وااااااااااا! "],
9140=>["Value"=>9140,"TextKey"=>"剧情ID2010202","TextValue"=>"كاهنة؟! "],
9141=>["Value"=>9141,"TextKey"=>"剧情ID2010203","TextValue"=>"أوه لا، كاهنتي, هل أنتِ في الأسفل؟ هل أنتِ بخير؟ "],
9142=>["Value"=>9142,"TextKey"=>"剧情ID2010204","TextValue"=>"امم ... لا زلت على قيد الحياة ... امم، أعتقد أنني تم ... اجتذابي داخل منجم السحر هذا. "],
9143=>["Value"=>9143,"TextKey"=>"剧情ID2010205","TextValue"=>"حمداً لله, أنتِ بخير. اطمئني رجاءً, سنبذل قصارى جهدنا لإنقاذك سريعاً. "],
9144=>["Value"=>9144,"TextKey"=>"剧情ID2010301","TextValue"=>"سيدي, وجدت مبناً مهجوراً على قمة تل قريب رأيت آلة حبال قش ضخمة بالداخل، لكنها مدفونة داخل فوضى من القمامة. "],
9145=>["Value"=>9145,"TextKey"=>"剧情ID2010302","TextValue"=>"أعتقد أنه نوع من <color=#f58c26>ورش العمل القديمة</color>. "],
9146=>["Value"=>9146,"TextKey"=>"剧情ID2010303","TextValue"=>"ربما يمكننا محاولة فتح بابه وتنظيف داخله وصنع حبل من القش وبناء إطار بكرة وسحب الكاهنة لأعلى؟ "],
9147=>["Value"=>9147,"TextKey"=>"剧情ID2010304","TextValue"=>"توقف عن الحديث واذهب لبناء شيء ما! "],
9148=>["Value"=>9148,"TextKey"=>"剧情ID2010305","TextValue"=>"لا تقلقي يا كاهنتي, لقد حل الظلام. سوف نتجمد حتى الموت إذا بقينا في الخارج؛ لذا سأقوم ببناء <color=#f58c26>خيمة</color> وسأفكر في الأمر عندما نحصل على قسط جيد من الراحة. "],
9149=>["Value"=>9149,"TextKey"=>"剧情ID2010306","TextValue"=>"ماذا عني؟ سأتجمد برداً! "],
9150=>["Value"=>9150,"TextKey"=>"剧情ID2010307","TextValue"=>"لا تهلعي، على الرغم من أن الاختلاف في درجات الحرارة بين النهار والليل على الأرض كبيرة جدًا، إلا أن درجة الحرارة تحت الأرض دائمًا مريحة ومستقرة. انتظري قليلاً يا كاهنة! "],
9151=>["Value"=>9151,"TextKey"=>"剧情ID2020101","TextValue"=>"اليوم التالي ..."],
9152=>["Value"=>9152,"TextKey"=>"剧情ID2020201","TextValue"=>"حصلت على قسطاً جيّداً من النوم! كاهنتي, كيف تشعرين بالأسفل؟ "],
9153=>["Value"=>9153,"TextKey"=>"剧情ID2020202","TextValue"=>"من الأفضل أن تجد طريقة لرفعي سريعاً بدلاً من سؤالي عن شعوري! "],
9154=>["Value"=>9154,"TextKey"=>"剧情ID2020203","TextValue"=>"نحن نفكر فقط أننا بحاجة إلى بعض الأدوات اللازمة لفتح باب ورشة العمل على قمة الجبل, فلا تقلقي, حسناً؟ *ابتسامة* "],
9155=>["Value"=>9155,"TextKey"=>"剧情ID2020204","TextValue"=>"انتظرني حين أصعد ... أيها الصبي المتغطرس "],
9156=>["Value"=>9156,"TextKey"=>"剧情ID2020205","TextValue"=>"آه، لقد آلمتني! كيف تسيئي فهم لطفي بهذه الطريقة! لكني أسامحك, سأعود أنا وزعيم القبيلة حالاً! "],
9157=>["Value"=>9157,"TextKey"=>"剧情ID2030201","TextValue"=>"حسنًا، نحن بالداخل! الآن نحن فقط بحاجة إلى ..."],
9158=>["Value"=>9158,"TextKey"=>"剧情ID2030202","TextValue"=>"سيدي احترس! خلفك! "],
9159=>["Value"=>9159,"TextKey"=>"剧情ID2030203","TextValue"=>"آه, من أين أتى هذا السهم؟! "],
9160=>["Value"=>9160,"TextKey"=>"剧情ID2030204","TextValue"=>"اخرج! "],
9161=>["Value"=>9161,"TextKey"=>"剧情ID2030205","TextValue"=>"من هناك؟ "],
9162=>["Value"=>9162,"TextKey"=>"剧情ID2030206","TextValue"=>"اخرج! خاطف! "],
9163=>["Value"=>9163,"TextKey"=>"剧情ID2030207","TextValue"=>"خاطف؟ أعتقد أنك أمسكت بالشخص الخطأ، صاحبة الصوت ... آه آه مؤلم! هذا مؤلم! "],
9164=>["Value"=>9164,"TextKey"=>"剧情ID2030301","TextValue"=>"سنخرج حالاً يا صاحبة الصوت, هل يمكنكِ شرح الوضع حالياً؟ "],
9165=>["Value"=>9165,"TextKey"=>"剧情ID2030302","TextValue"=>"بادئ الأمر، أنا لا أُدعى صاحبة الصوت. أنا ترازيغا, صائدة البرق .. ابنة مورو .. أم الأرض .. البطلة الـ ..."],
9166=>["Value"=>9166,"TextKey"=>"剧情ID2030303","TextValue"=>"ترازيغا العظيمة!!!!!"],
9167=>["Value"=>9167,"TextKey"=>"剧情ID2030304","TextValue"=>"ماذا ... من أين يأتي هذا الصوت ... عند سفح الجبل؟ أوقع شخص ما داخل ذلك المنجم؟ "],
9168=>["Value"=>9168,"TextKey"=>"剧情ID2030305","TextValue"=>"ثلاثتكم, ابقوا هنا حتى أعود! إذا وجدت أحدكم قد تحرك خطوة واحدة, تعلمون ما سيحدث. "],
9169=>["Value"=>9169,"TextKey"=>"剧情ID2030306","TextValue"=>"حسناً سيدتي, لن نتحرك! "],
9170=>["Value"=>9170,"TextKey"=>"剧情ID2030401","TextValue"=>"ها أنتِ ذا, كاهنة؟ ماذا تفعلين هنا؟ لقد فتحت هذا المنجم أثناء بحثي عن شخص، ولكن كيف انتهي الأمر بكِ داخله؟ "],
9171=>["Value"=>9171,"TextKey"=>"剧情ID2030402","TextValue"=>"القصة باختصار، جئت مع هؤلاء الأولاد الذين قبضت عليهم، لكنني وقعت داخل هذا المنجم, لكن هذا لا يهم, لقد التقينا بك!! توقعت أننا سنلتقي بصديق يمكنه مساعدتنا في هذه الأرض القاحلة. هذا الصديق هو أنت!! "],
9172=>["Value"=>9172,"TextKey"=>"剧情ID2030403","TextValue"=>"صديق؟ أساعدكم؟ بماذا؟ أنتم ... لستم خاطفين؟"],
9173=>["Value"=>9173,"TextKey"=>"剧情ID2030404","TextValue"=>"خاطفين؟ كلا كلا, نحن عابرو سبيل, نحاول العثور على مساعد يمكنه إنقاذ موطننا بهذه الرحلة *تشرح*"],
9174=>["Value"=>9174,"TextKey"=>"剧情ID2030405","TextValue"=>"ها, بقولك هذا, أخبرتني أمي انني سألتقي بمجموعة من الأشخاص مثلكم ... لكنها اختفت بعد ذلك, يعني هذا أني أمسكت الشخص الخطأ. "],
9175=>["Value"=>9175,"TextKey"=>"剧情ID2030406","TextValue"=>"والدتك؟ "],
9176=>["Value"=>9176,"TextKey"=>"剧情ID2030407","TextValue"=>"لا تهتمي, لا بأس. أعتقد أن هؤلاء الأولاد وقعوا في فخي عندما حاولوا إصلاح آلة القش تلك لرفعك؟ "],
9177=>["Value"=>9177,"TextKey"=>"剧情ID2030408","TextValue"=>"صحيح أيتها السيدة الحكيمة، أنتِ مُحقة. لهذا السبب أنا على هذا النحو الآن، بقدم واحدة فقط يمكنني استخدامها. "],
9178=>["Value"=>9178,"TextKey"=>"剧情ID2030409","TextValue"=>"يا إلهي, أعتذر هذا خطأي. سأساعدك على الشفاء لاحقًا, الآن سأساعدكم في إزالة الفخ أولاً، ثم إصلاح آلة حبل القش ..."],
9179=>["Value"=>9179,"TextKey"=>"剧情ID2030501","TextValue"=>"تم اصلاح آلة حبل القش, أنت مذهلة يا سيدتي! "],
9180=>["Value"=>9180,"TextKey"=>"剧情ID2030592","TextValue"=>"لا على الإطلاق! اسحبيني! الآن, فوراً! "],
9181=>["Value"=>9181,"TextKey"=>"剧情ID2030683","TextValue"=>"تبقت خطوة واحدة فقط, علينا صنع حبل لرفعك. "],
9182=>["Value"=>9182,"TextKey"=>"剧情ID2030774","TextValue"=>"أعتقد أنكِ ضدي ... *بكاء*"],
9183=>["Value"=>9183,"TextKey"=>"剧情ID2040101","TextValue"=>"سيدي, هل جمعت جميع المواد؟ في الواقع لا يهم إذا كنت بطيئاً، لأن الكاهنة إندا ليست هنا الآن، يمكننا الاسترخاء قليلاً ..."],
9184=>["Value"=>9184,"TextKey"=>"剧情ID2040102","TextValue"=>"استطيع سماعك! اظهر احترامك! "],
9185=>["Value"=>9185,"TextKey"=>"剧情ID2040103","TextValue"=>"تباً! لم أعلم أن بإمكانها سماعنا ... أها! البكرة جاهزة! "],
9186=>["Value"=>9186,"TextKey"=>"剧情ID2040201","TextValue"=>"كاهنتي العزيزة، لقد نزل فريق الإنقاذ, يُرجى الوقوف في مكان يمكن للآخرين رؤيته بحال حدوث تدافع ..."],
9187=>["Value"=>9187,"TextKey"=>"剧情ID2040202","TextValue"=>"لقد دعست خصري! انهض عني!"],
9188=>["Value"=>9188,"TextKey"=>"剧情ID2040203","TextValue"=>"يبدو أن الكاهنة ستصعد قريبًا, شكراً جزيلاً لكِ سيدتي. "],
9189=>["Value"=>9189,"TextKey"=>"剧情ID2040204","TextValue"=>"لا تدعوني بسيدتي, أُدعى ترازيغا. الآن أرني أين أُصبت؟ "],
9190=>["Value"=>9190,"TextKey"=>"剧情ID2040205","TextValue"=>"لقد أصبتني في ساقي سيدتي, أعني, ترازيغا. "],
9191=>["Value"=>9191,"TextKey"=>"剧情ID2040206","TextValue"=>"فهمت, نحن الصيادون جيدون في العناية بالجروح. احتفظت بكيس من الأوراق تحت المنجم, لقد استخدمت المنجم كغرفة تخزين. فلنزرع بعض الأوراق ونضع العُصارة على ساقك ~ "],
9192=>["Value"=>9192,"TextKey"=>"剧情ID2040207","TextValue"=>"أوه ... ساقي ... حسنًا, إذاً نحن ذاهبون إلى المنجم الآن؟ "],
9193=>["Value"=>9193,"TextKey"=>"剧情ID2040208","TextValue"=>"لا لا, عليكم استخدام المشاعل بالأسفل للرؤية, فهذا أعمق مما تعتقد. اذهب وابحث عن مشاعل وأدوات الحفر! "],
9194=>["Value"=>9194,"TextKey"=>"剧情ID2050101","TextValue"=>"خد هذا, إذا انطفأت النيران فلا تتقدم، توقف قليلاً ثُم عُد، حسنًا؟ "],
9195=>["Value"=>9195,"TextKey"=>"剧情ID2050102","TextValue"=>"مستعد؟ سنذهب! حاذر خطواتك! "],
9196=>["Value"=>9196,"TextKey"=>"剧情ID2050103","TextValue"=>"حسناً سيدتي! "],
9197=>["Value"=>9197,"TextKey"=>"剧情ID2050104","TextValue"=>"سيدي، أشكرك لبقاءك معي ومع الكاهنة بالأعلى, أنا ممتن جداً. قالت ترازيغا يمكنني النزول إلى الأسفل ما لم أحتاج لساقي, لكنني أتطلع إلى ما سيحضرونه إلينا! "],
9198=>["Value"=>9198,"TextKey"=>"剧情ID2050105","TextValue"=>"لا أصدق أن ترازيغا العظيمة طلبت منك أن تناديها باسمها, يا له من شرف عظيم! ثم لم تُظهر امتنانك على الإطلاق ..."],
9199=>["Value"=>9199,"TextKey"=>"剧情ID2050201","TextValue"=>"يا إلهى ما هذا؟ "],
9200=>["Value"=>9200,"TextKey"=>"剧情ID2050202","TextValue"=>"إنه النهر الجوفي! وجد فريقنا <color=#f58c26>نهرًا جوفياً</color>! لدينا ماء! "],
9201=>["Value"=>9201,"TextKey"=>"剧情ID2050203","TextValue"=>"إنه مبلل أيضًا. "],
9202=>["Value"=>9202,"TextKey"=>"剧情ID2050204","TextValue"=>"خذوا الأمر بروية ايها الجُبناء! إنه ماء فقط!"],
9203=>["Value"=>9203,"TextKey"=>"剧情ID2050205","TextValue"=>"أنت يا زعيم القبيلة, لديك ماء الآن, فلنزرع بعض <color=#f58c26>النباتات النضرة</color>! بالرعاية والعناية المناسبة ستنمو الورقة لتصبح نباتاً نضراً!"],
9204=>["Value"=>9204,"TextKey"=>"剧情ID2050206","TextValue"=>"هؤلاء الفتيات لك, دعهم يجدون بعض الدلاء والمجارف والأسمدة. سأنتظر هنا. "],
9205=>["Value"=>9205,"TextKey"=>"剧情ID2060101","TextValue"=>"حسناً انتهينا! تبدو لطيفة! تعال واسحب ورقة كبيرة. "],
9206=>["Value"=>9206,"TextKey"=>"剧情ID2060102","TextValue"=>"لم أرَ نباتاً كهذا من قبل ... ماذا؟ أسحب ورقة؟ "],
9207=>["Value"=>9207,"TextKey"=>"剧情ID2060103","TextValue"=>"أجل, اسحب واحدة واستخرج عُصارتها وضعها على بشرتك المُصابة. "],
9208=>["Value"=>9208,"TextKey"=>"剧情ID2060104","TextValue"=>"حسناً ... اسحب ورقة ... أضع ... واو, إنه يعمل حقًا! لم أسمع أبدًا عن عشب يمكنه شفاء الجروح بهذه السرعة! "],
9209=>["Value"=>9209,"TextKey"=>"剧情ID2060105","TextValue"=>"حسنًا، أرضنا الأم لا تُعاني من أجل لا شيء. أعتقد أن الناس أعطوني هذا اللقب لأنني أُجيد البستنة. هذه ليست عصارة عادية, لقد طرحتها. "],
9210=>["Value"=>9210,"TextKey"=>"剧情ID2060106","TextValue"=>"معجزة الخالق! إلهي؟ أعتقد الآن أن سر موطننا سيتم حله قريبًا! "],
9211=>["Value"=>9211,"TextKey"=>"剧情ID2060107","TextValue"=>"لأكون صادقةً حول ذلك, أنا مرهقة وبحاجة للنوم. هل تمانع إذا ذهبت إلى موطنكم لأخذ قيلولة؟ هل تشبه كالقاعدة؟ هل هناك سرير؟ "],
9212=>["Value"=>9212,"TextKey"=>"剧情ID2060108","TextValue"=>"نعم، تشبه القاعدة نوعًا ما، وهذه هي خريطة العودة. لكن ... هل تخططين لقضاء ليلة أم ستنضمين إلينا؟ "],
9213=>["Value"=>9213,"TextKey"=>"剧情ID2060109","TextValue"=>"بالطبع انضممت إلى فريقكم, هل أنت أحمق؟! أنتم بحاجة للمساعدة, وليس لديّ شيء لفعله الآن, لم لا؟ ربما نبحث عن نفس الشخص على أي حال, لذا! سآخذ الخريطة, وداعاً! "],
9214=>["Value"=>9214,"TextKey"=>"剧情ID2060201","TextValue"=>"ثم غادرت, أشعر أنها ستصبح صديقة جيدة لشعبنا. دعونا نواصل ما نفعله وننهي المعسكر تمامًا كمعسكرنا السابق، نحتاج إلى <color=#f58c26>مستودع</color> لتخزين الموارد. "],
9215=>["Value"=>9215,"TextKey"=>"剧情ID2060202","TextValue"=>"فلنجمع بعض الموارد لبناء <color=#f58c26>المستودع</color>! "],
9216=>["Value"=>9216,"TextKey"=>"剧情ID2070101","TextValue"=>"جيد! "],
9217=>["Value"=>9217,"TextKey"=>"剧情ID2070102","TextValue"=>"لم تشكرني بعد على إيجاد نبع المياه لكم! أخبركم أن ما أشعر به حيال هذا المكان حقيقي! "],
9218=>["Value"=>9218,"TextKey"=>"剧情ID2070103","TextValue"=>"حسناً حسناً, سأضع كامل ثقتي في تكهناتك وسأُلبي جميع مطالبك الغير معقولة, ماذا بعد؟ "],
9219=>["Value"=>9219,"TextKey"=>"剧情ID2070104","TextValue"=>"أنت! انسَ الأمر. أحتاج إلى التواصل مع الإله مرةً أخرى لتحديد الاتجاه التالي, أحتاج هذه المرة إلى <color=#f58c26>برج مراقبة</color> لأحاول التكهن الفلكي. "],
9220=>["Value"=>9220,"TextKey"=>"剧情ID2070105","TextValue"=>"لماذا علم الفلك؟ لا نعرف حتى ما هي تلك النجوم، أعني، إنها مجرد نقاط مضيئة صغيرة في السماء! "],
9221=>["Value"=>9221,"TextKey"=>"剧情ID2070106","TextValue"=>"ليس لدينا وقت نضيعه! هناك الكثير من العمل للقيام به! توقف عن الثرثرة! "],
9222=>["Value"=>9222,"TextKey"=>"剧情ID2070107","TextValue"=>"اذهب وابحث عما أحتاجه, أسرع! "],
9223=>["Value"=>9223,"TextKey"=>"剧情ID2070108","TextValue"=>"حسناً ..."],
9224=>["Value"=>9224,"TextKey"=>"剧情ID2070201","TextValue"=>"يقول الكبار ألا تعبث مع كبار السن, لماذا لم استمع إليهم ..."],
9225=>["Value"=>9225,"TextKey"=>"剧情ID2080101","TextValue"=>"حسنًا زعيم القبيلة، لقد أنهيت ما ستفعله, الباقي هو بناء <color=#f58c26>برج المراقبة</color> الذي طلبت مني الكاهنة بناءه ..."],
9226=>["Value"=>9226,"TextKey"=>"剧情ID2080102","TextValue"=>"أنا أستمع أيها الفتى! توقف عن الشكوى وقم بعملك! "],
9227=>["Value"=>9227,"TextKey"=>"剧情ID2080103","TextValue"=>"حسناً ~ حسناً ~ *تنهد*"],
9228=>["Value"=>9228,"TextKey"=>"剧情ID2080201","TextValue"=>"حسناً يا سيدي, اذهب للتحدث مع الإله. "],
9229=>["Value"=>9229,"TextKey"=>"剧情ID2080202","TextValue"=>"استرح قليلاً, أراك بعد قليل. "],
9230=>["Value"=>9230,"TextKey"=>"剧情ID2080203","TextValue"=>"*صوت منخفض* هنا هنا, سيدي ..."],
9231=>["Value"=>9231,"TextKey"=>"剧情ID2080204","TextValue"=>"إندا ستتوقف أخيراً. "],
9232=>["Value"=>9232,"TextKey"=>"剧情ID2080205","TextValue"=>"وجد فريقنا كومة من الذهب تحت المنجم. "],
9233=>["Value"=>9233,"TextKey"=>"剧情ID2080206","TextValue"=>"كنا نتساءل عما إذا كان بإمكاننا صنع صندوق لنقلهم، لذا جئنا هنا لطلب مساعدتك. "],
9234=>["Value"=>9234,"TextKey"=>"剧情ID2080207","TextValue"=>"هل تمانع في جمع بعض المواد لنا لصنع الصناديق؟ "],
9235=>["Value"=>9235,"TextKey"=>"剧情ID2090101","TextValue"=>"أوه، هذا كثير من الذهب. "],
9236=>["Value"=>9236,"TextKey"=>"剧情ID2090102","TextValue"=>"ما هذا؟ إنه يُضيء ..."],
9237=>["Value"=>9237,"TextKey"=>"剧情ID2090201","TextValue"=>"حقيبة صغيرة ... مكتوب أعلاها "تناولني", وبداخلها ... <color=#f58c26>بذرة مُضيئة</color>؟ أتعني أن نأكل هذه البذرة؟ "],
9238=>["Value"=>9238,"TextKey"=>"剧情ID2090202","TextValue"=>"ضعني أرضاً! "],
9239=>["Value"=>9239,"TextKey"=>"剧情ID2090203","TextValue"=>"ماذا! كاهنتي, ماذا تفعلين! "],
9240=>["Value"=>9240,"TextKey"=>"剧情ID2090301","TextValue"=>"هل تناولتها؟ لم نعلم بعد ماهيتها! "],
9241=>["Value"=>9241,"TextKey"=>"剧情ID2090302","TextValue"=>"ترشدني النجوم إلى <color=#f58c26>الوادي العظيم</color> في <color=#f58c26>الجنوب الشرقي</color>، وستساعدني هذه <color=#f58c26>البذرة المنومة</color> على الالتقاء بـ ... *شخير* "],
9242=>["Value"=>9242,"TextKey"=>"剧情ID2090303","TextValue"=>"كاهنة؟ كاهنة؟ ألا زلت هنا؟ "],
9243=>["Value"=>9243,"TextKey"=>"剧情ID2090304","TextValue"=>"*شخير* "],
9244=>["Value"=>9244,"TextKey"=>"剧情ID2090305","TextValue"=>"غفت. لا أفهم هؤلاء الوسطاء الروحيين, يصعب تفسيرهم أحياناً. "],
9245=>["Value"=>9245,"TextKey"=>"剧情ID2090306","TextValue"=>"فقدت الكاهنة وعيها, أين نذهب بعد ذلك؟ "],
9246=>["Value"=>9246,"TextKey"=>"剧情ID2090307","TextValue"=>"قالت <color=#f58c26>الوادي العظيم</color>, أليس كذلك؟ نتجه نحو <color=#f58c26>الجنوب الشرقي</color>؟ "],
9247=>["Value"=>9247,"TextKey"=>"剧情ID2090308","TextValue"=>"أنصدقها؟ يبدو أنها ... ليست طبيعية؟ "],
9248=>["Value"=>9248,"TextKey"=>"剧情ID2090309","TextValue"=>"بالتأكيد, لقد وعدتها أنني سأثق بها في المستقبل. إضافةً إلى ذلك، أين يمكننا الذهاب؟ لنأخذ قسطًا من الراحة اليوم، ثم ننطلق نحو الجنوب الشرقي غدًا. "],
9249=>["Value"=>9249,"TextKey"=>"剧情ID3010101","TextValue"=>"هيي, أنت هناك. "],
9250=>["Value"=>9250,"TextKey"=>"剧情ID3010102","TextValue"=>"أنا؟ "],
9251=>["Value"=>9251,"TextKey"=>"剧情ID3010103","TextValue"=>"نعم! أنت. هل تمانع في مساعدة السيدة العجوز؟ "],
9252=>["Value"=>9252,"TextKey"=>"剧情ID3010104","TextValue"=>"امم ... أنا لست هنا في الحقيقة. "],
9253=>["Value"=>9253,"TextKey"=>"剧情ID3010105","TextValue"=>"ماذا؟ لمَ؟ "],
9254=>["Value"=>9254,"TextKey"=>"剧情ID3010106","TextValue"=>"أنا مع أفراد قبيلتي نتجول بحثًا عن مساعدة لحل لغز وطننا ..."],
9255=>["Value"=>9255,"TextKey"=>"剧情ID3010107","TextValue"=>"فهمت, أنا أتحدث إلى عقلك عبر المربع الصغير المضيء في يدك؟ "],
9256=>["Value"=>9256,"TextKey"=>"剧情ID3010108","TextValue"=>"أتعني <color=#f58c26>هاتفي الخلوي</color>؟ "],
9257=>["Value"=>9257,"TextKey"=>"剧情ID3010109","TextValue"=>"أجل, هذا الـ <color=#f58c26>"هاتفي الخلوي"</color>, هل توافق على مساعدتي؟ "],
9258=>["Value"=>9258,"TextKey"=>"剧情ID3010110","TextValue"=>"انتظر ... كيف بإمكانك سماعي؟ "],
9259=>["Value"=>9259,"TextKey"=>"剧情ID3010111","TextValue"=>"أوه عزيزي، أنا ضرير لكن يمكنني الشعور بكل شيء, أتفهم؟ الآن، هل ستساعدني؟ "],
9260=>["Value"=>9260,"TextKey"=>"剧情ID3010112","TextValue"=>"حسناً, ماذا تريد؟ "],
9261=>["Value"=>9261,"TextKey"=>"剧情ID3010113","TextValue"=>"قبيلتك ستمر هنا، أليس كذلك؟ تظاهرت بالجوع وبنيت <color=#f58c26>كشكًا صغيرًا</color> لبيع الخردة. يا إلهي! يا لي من عبقري! "],
9262=>["Value"=>9262,"TextKey"=>"剧情ID3010114","TextValue"=>"لا أفهم ..."],
9263=>["Value"=>9263,"TextKey"=>"剧情ID3010115","TextValue"=>"لا أريد مساعدة شخصاً وقحاً، أليس كذلك؟ أنا أساعد فقط الأشخاص الطيبين.  "],
9264=>["Value"=>9264,"TextKey"=>"剧情ID3010116","TextValue"=>"لذلك؟ "],
