9373=>["Value"=>9373,"TextKey"=>"剧情ID3070108","TextValue"=>"لا كلا! لن يمر شيء، ولن أفهم شيئًا !! إلهي ... من أين أنت! "],
9374=>["Value"=>9374,"TextKey"=>"剧情ID3070109","TextValue"=>"بما أنك سألتني بشكل موقر, في الواقع، بفضل شاي الظهيرة هذا ... "],
9375=>["Value"=>9375,"TextKey"=>"剧情ID3070110","TextValue"=>"استعدت ذاكرتي. في الحقيقة، أعني، لأكون صادقةً، لأكون عقلانيةً، لأكون صادقةً ... "],
9376=>["Value"=>9376,"TextKey"=>"剧情ID3070111","TextValue"=>"تحدثي مباشرةً؟! "],
9377=>["Value"=>9377,"TextKey"=>"剧情ID3070112","TextValue"=>"هل يمكنكم مساعدتي في تعزيز <color=#f58c26>الكشك</color>؟ "],
9378=>["Value"=>9378,"TextKey"=>"剧情ID3070113","TextValue"=>"ماذا؟ "],
9379=>["Value"=>9379,"TextKey"=>"剧情ID3070114","TextValue"=>"أنا عجوز نحيفة في صحراء جوبي، لقد كنت أسير بمفردي لفترة طويلة. أنا جائعة ... آه! يا للأسف! "],
9380=>["Value"=>9380,"TextKey"=>"剧情ID3070115","TextValue"=>"سأحزن كثيراً إذا تعطل هذا الكشك, لذا أرجوكم! سأكون ممتنةً للغاية! "],
9381=>["Value"=>9381,"TextKey"=>"剧情ID3070116","TextValue"=>"يا لها من عجوز مثيرة للاهتمام. "],
9382=>["Value"=>9382,"TextKey"=>"剧情ID3070117","TextValue"=>"عذراً ماذا قلت؟ "],
9383=>["Value"=>9383,"TextKey"=>"剧情ID3070118","TextValue"=>"سيدي، تم تجهيز قائمة المواد لك. يُرجى التأكد! "],
9384=>["Value"=>9384,"TextKey"=>"剧情ID3070119","TextValue"=>"لا تتجاهلني!! "],
9385=>["Value"=>9385,"TextKey"=>"剧情ID3080101","TextValue"=>"أنتم رائعون! "],
9386=>["Value"=>9386,"TextKey"=>"剧情ID3080102","TextValue"=>"أمي! كنت أعلم! كنت أعلم أنها أنتِ! "],
9387=>["Value"=>9387,"TextKey"=>"剧情ID3080201","TextValue"=>"ترازيغا العظيمة, لماذا أنتِ هنا؟! "],
9388=>["Value"=>9388,"TextKey"=>"剧情ID3080202","TextValue"=>"هذه الفتاة هي ...؟"],
9389=>["Value"=>9389,"TextKey"=>"剧情ID3080203","TextValue"=>"ترازيغا! ابنتك! كفي عن التظاهر! "],
9390=>["Value"=>9390,"TextKey"=>"剧情ID3080204","TextValue"=>"أخبرني الرسول أنهم أخرجوا امرأة عجوز ضريرة في حفرة, سمعت أنها تشبهك لذا أتيت لإلقاء نظرة. "],
9391=>["Value"=>9391,"TextKey"=>"剧情ID3080205","TextValue"=>"إنها أنتِ! "],
9392=>["Value"=>9392,"TextKey"=>"剧情ID3080206","TextValue"=>"والدة ترازيغا ... لم أعلم أن أن ترازيغا لديها والدة ..."],
9393=>["Value"=>9393,"TextKey"=>"剧情ID3080207","TextValue"=>"بالطبع لديّ أم أيها الأحمق! "],
9394=>["Value"=>9394,"TextKey"=>"剧情ID3080208","TextValue"=>"راقبي ألفاظك. "],
9395=>["Value"=>9395,"TextKey"=>"剧情ID3080209","TextValue"=>"هذه السيدة المجنونة هي موروس الخاصة بكم, أمامكم مباشرة. "],
9396=>["Value"=>9396,"TextKey"=>"剧情ID3080210","TextValue"=>"ادعوني ميج. "],
9397=>["Value"=>9397,"TextKey"=>"剧情ID3080211","TextValue"=>"اعتقدت أن موروس هو رجل ..."],
9398=>["Value"=>9398,"TextKey"=>"剧情ID3080212","TextValue"=>"حسنًا، بإمكان والدتي أن تصبح العديد من الأشخاص, لقد أخفت هويتها الحقيقية عن الناس عندما كنت طفلة. "],
9399=>["Value"=>9399,"TextKey"=>"剧情ID3080213","TextValue"=>"من تعتقد يسهل استخدامه من النساء المكفوفات والأشخاص الذين يبلغون من العمر ثلاث سنوات؟ "],
9400=>["Value"=>9400,"TextKey"=>"剧情ID3080214","TextValue"=>"أعتقد أن هذه هي الطريقة التي بدأ بها الناس في نشر القصة ... الكهنة القادرون، المحاربون العالمون، الفرسان الأقوياء ..."],
9401=>["Value"=>9401,"TextKey"=>"剧情ID3080215","TextValue"=>"في الحقيقة، هي ليست سوى عجوز ضريرة تتمتع بروح دعابة غريبة. "],
9402=>["Value"=>9402,"TextKey"=>"剧情ID3080216","TextValue"=>"موروس امرأة ... أدليت بملاحظات وقحة لموروس ... أوه، انتهى أمري، لا أستحق أن أكون كاهنة ..."],
9403=>["Value"=>9403,"TextKey"=>"剧情ID3080217","TextValue"=>"لا تحزن يا كاهنة, ستتعلمين جيدًا ~ أسامحك هذه المرة لأنك لطيفة جدًا ~"],
9404=>["Value"=>9404,"TextKey"=>"剧情ID3080218","TextValue"=>"هل خدعتنا؟ لم تفقدي ذاكرتك؟ "],
9405=>["Value"=>9405,"TextKey"=>"剧情ID3080219","TextValue"=>"نعم آسفة, السفر لمسافات طويلة ممل جداً، أليس كذلك؟ نريد الاستمتاع قليلاً   "],
9406=>["Value"=>9406,"TextKey"=>"剧情ID3080220","TextValue"=>"لكن، انظروا إلى تلك الخيمة الجميلة وهذا المتجر الصغير الجميل! يشبه الآن "المعسكر"! كل ما بالأمر أن هناك شيئًا خاطئًا ... "],
9407=>["Value"=>9407,"TextKey"=>"剧情ID3080221","TextValue"=>"ما هي العيوب؟ "],
9408=>["Value"=>9408,"TextKey"=>"剧情ID3080222","TextValue"=>"لنرى ..."],
9409=>["Value"=>9409,"TextKey"=>"剧情ID3080301","TextValue"=>"بوابة! أنتم بحاجة إلى بوابة لتحديد مدخل المخيم ثم تزيينها ببعض الأضواء، وستصبح جميلة بشكل لا يضاهى! "],
9410=>["Value"=>9410,"TextKey"=>"剧情ID3080302","TextValue"=>"كخدمك المخلصين؛ سنقوم ببناء هذه البوابة على الفور، سيدتي! سيدي, توقع عن التسكع! "],
9411=>["Value"=>9411,"TextKey"=>"剧情ID3090101","TextValue"=>"تم تجهيز المواد! ابدأوا العمل ابدأوا العمل!"],
9412=>["Value"=>9412,"TextKey"=>"剧情ID3090201","TextValue"=>"أوه! أشعر بالنشاط! هذه أول مرة أتولى فيها مسؤولية مشروع بناء ..."],
9413=>["Value"=>9413,"TextKey"=>"剧情ID3090202","TextValue"=>"مبارك أيتها الكاهنة, لقد نضجت كثيرًا. لكن لا اعلم ما إن كانت ميج راضية عن شكل معسكرنا الآن أم لا؟ "],
9414=>["Value"=>9414,"TextKey"=>"剧情ID3090203","TextValue"=>"كل شيء آخر جيد، لكن تلك السماء الفارغة مملة بعض الشيء ..."],
9415=>["Value"=>9415,"TextKey"=>"剧情ID3090204","TextValue"=>"فهمت! فهمت! لدينا بعض بالونات الإشارة بإمكانها أن تطفو في السماء! "],
9416=>["Value"=>9416,"TextKey"=>"剧情ID3090205","TextValue"=>"فكرة جيدة! تلك الأشياء الصغيرة تحتاج إلى بعض الضبط الدقيق وستصبح أكثر جمالاً! "],
9417=>["Value"=>9417,"TextKey"=>"剧情ID3090206","TextValue"=>"هل تبقى لديكم أي من الأحجار الصغيرة الصفراء والوردية المتوهجة؟ "],
9418=>["Value"=>9418,"TextKey"=>"剧情ID3090207","TextValue"=>"أجل! "],
9419=>["Value"=>9419,"TextKey"=>"剧情ID3090208","TextValue"=>"جيد, انتظر قليلاً. كيفين تعال معي. "],
9420=>["Value"=>9420,"TextKey"=>"剧情ID3090301","TextValue"=>"أوه أنا مرهق كثيراً, لكن انظر إلى هذه الأدوات! جميلة أم لا؟ "],
9421=>["Value"=>9421,"TextKey"=>"剧情ID3090302","TextValue"=>"حقيقةً. "],
9422=>["Value"=>9422,"TextKey"=>"剧情ID3090303","TextValue"=>"يكفي أن تعجبكم, والدتي تصنع أشياءاً غير عادية. لقد تأخر الوقت على أي حال, سأعود. "],
9423=>["Value"=>9423,"TextKey"=>"剧情ID3090304","TextValue"=>"ستذهبين الآن؟ "],
9424=>["Value"=>9424,"TextKey"=>"剧情ID3090305","TextValue"=>"أجل, ماذا أيضًا؟ لا أريد أن أتشارك خيمة صغيرة معكم أيها المسنون ذوو الرائحة الكريهة! أمي، هل ستأتين معي؟ "],
9425=>["Value"=>9425,"TextKey"=>"剧情ID3090306","TextValue"=>"سألحق بكِ لاحقًا, يبدو أصدقاؤك الجدد لطيفون حقاً, خاصة الكاهنة ~ أريد أن ألعب معهم لبعض الوقت ~ "],
9426=>["Value"=>9426,"TextKey"=>"剧情ID3090307","TextValue"=>"أمي, تمالكي نفسك. "],
9427=>["Value"=>9427,"TextKey"=>"剧情ID3090308","TextValue"=>"فهمت فهمت, حسناً. لدينا طريقاً طويلاً لنقطعه معاً. "],
9428=>["Value"=>9428,"TextKey"=>"剧情ID3090309","TextValue"=>"حسناً, أراكم لاحقاً. "],
9429=>["Value"=>9429,"TextKey"=>"剧情ID3090401","TextValue"=>"أتعنين أنكِ ستنضمين إلينا؟ "],
9430=>["Value"=>9430,"TextKey"=>"剧情ID3090402","TextValue"=>"بالطبع! لم لا! ستزداد رحلتكم صعوبةً. "],
9431=>["Value"=>9431,"TextKey"=>"剧情ID3090403","TextValue"=>"لن أستطيع فعل الكثير، لكن على الأقل يمكنني إخباركم شيئًا عن المستقبل. "],
9432=>["Value"=>9432,"TextKey"=>"剧情ID3090404","TextValue"=>"لكن عليكم أن تدلوني على الطريق إلى موطنكم, فحسّي بالاتجاه ... سيء بشكل لا يمكن تصوره. "],
9433=>["Value"=>9433,"TextKey"=>"剧情ID4010101","TextValue"=>"Ouch…Why does such a place exist on the earth?! My feet feel like stepping on flames nonstop…"],
9434=>["Value"=>9434,"TextKey"=>"剧情ID4010102","TextValue"=>"Impressive, Enda! Sigh…You haven't spoken more than five words since four hours ago."],
9435=>["Value"=>9435,"TextKey"=>"剧情ID4010103","TextValue"=>"I'm…too tired…too hot…"],
9436=>["Value"=>9436,"TextKey"=>"剧情ID4010104","TextValue"=>"You bunch of fragile baby dolls! It is merely a volcano. Look at your postures like you are gonna lie down on the ground!"],
9437=>["Value"=>9437,"TextKey"=>"剧情ID4010105","TextValue"=>"Ma'am… You've also been sweating like a running stream. Are you alright?"],
9438=>["Value"=>9438,"TextKey"=>"剧情ID4010106","TextValue"=>"Call me Tlachtga!... I'm not tired, but it is indeed very hot here… which is far more dangerous than at sea."],
9439=>["Value"=>9439,"TextKey"=>"剧情ID4010107","TextValue"=>"It seems we've arrived."],
9440=>["Value"=>9440,"TextKey"=>"剧情ID4010108","TextValue"=>"Let me see! According to the Goddess's instructions, there's a sea on flames with islands in it…"],
9441=>["Value"=>9441,"TextKey"=>"剧情ID4010109","TextValue"=>"Yes, it must be here!"],
9442=>["Value"=>9442,"TextKey"=>"剧情ID4010110","TextValue"=>"But where is Amergin? Amergin should have been arrived and waiting for us here. But he can't be seen anywhere."],
9443=>["Value"=>9443,"TextKey"=>"剧情ID4010111","TextValue"=>"I should build an altar to sense Amergin's traces. But…"],
9444=>["Value"=>9444,"TextKey"=>"剧情ID4010201","TextValue"=>"Ow… Chief, I…"],
9445=>["Value"=>9445,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
9446=>["Value"=>9446,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
9447=>["Value"=>9447,"TextKey"=>"剧情ID4010204","TextValue"=>"She must have a heat stroke! Hurry up! Build a shade for her to rest!"],
9448=>["Value"=>9448,"TextKey"=>"剧情ID4020101","TextValue"=>"Sir, the construction is completed!"],
9449=>["Value"=>9449,"TextKey"=>"剧情ID4020102","TextValue"=>"Goddess, I seem to be able to live a little longer…"],
9450=>["Value"=>9450,"TextKey"=>"剧情ID4020103","TextValue"=>"It's indeed too hot! I miss the smell of the sea so much…"],
9451=>["Value"=>9451,"TextKey"=>"剧情ID4020104","TextValue"=>"Phew, our priest looks much better."],
9452=>["Value"=>9452,"TextKey"=>"剧情ID4020105","TextValue"=>"It's a little bit better to have a tent shielding us from overwhelming hot air…"],
9453=>["Value"=>9453,"TextKey"=>"剧情ID4020106","TextValue"=>"But just a little bit."],
9454=>["Value"=>9454,"TextKey"=>"剧情ID4020107","TextValue"=>"Your holy Goddess! Please turn me over, so I can be barbecued evenly…"],
9455=>["Value"=>9455,"TextKey"=>"剧情ID4020108","TextValue"=>"I have to say it sure feels like a big stove here."],
9456=>["Value"=>9456,"TextKey"=>"剧情ID4020109","TextValue"=>"Look! The lowlands over there!"],
9457=>["Value"=>9457,"TextKey"=>"剧情ID4020110","TextValue"=>"Behold you guys! My mother literally gave birth to a genius."],
9458=>["Value"=>9458,"TextKey"=>"剧情ID4030101","TextValue"=>"Awesome Tlachtga! That's water! WATER!!"],
9459=>["Value"=>9459,"TextKey"=>"剧情ID4030102","TextValue"=>"Hah, I thought our pious priest saw the Goddess."],
9460=>["Value"=>9460,"TextKey"=>"剧情ID4030103","TextValue"=>"I've come back to life, and I'm feeling pretty well!"],
9461=>["Value"=>9461,"TextKey"=>"剧情ID4030104","TextValue"=>"I can see you guys are indeed more energetic!"],
9462=>["Value"=>9462,"TextKey"=>"剧情ID4030105","TextValue"=>"In this case... you, you and you, hurry up and go build a Training Ring!"],
9463=>["Value"=>9463,"TextKey"=>"剧情ID4030106","TextValue"=>"Training Ring?"],
9464=>["Value"=>9464,"TextKey"=>"剧情ID4030107","TextValue"=>"Yup, correct!"],
9465=>["Value"=>9465,"TextKey"=>"剧情ID4030108","TextValue"=>"Shouldn't we be looking for Amergin?"],
9466=>["Value"=>9466,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin… that old man. I know he can control the forces of nature like a piece of cake."],
9467=>["Value"=>9467,"TextKey"=>"剧情ID4030110","TextValue"=>"Back at you guys, walking here literally took half of your lives. How can we leave physical training behind?"],
9468=>["Value"=>9468,"TextKey"=>"剧情ID4030111","TextValue"=>"Well, Enda does need more exercise."],
9469=>["Value"=>9469,"TextKey"=>"剧情ID4030112","TextValue"=>"Shut up!"],
9470=>["Value"=>9470,"TextKey"=>"剧情ID4030113","TextValue"=>"According to my mother's prophecy, there will be only stronger storms awaiting us…"],
9471=>["Value"=>9471,"TextKey"=>"剧情ID4030114","TextValue"=>"Mug Ruith's prophecy…"],
9472=>["Value"=>9472,"TextKey"=>"剧情ID4030115","TextValue"=>"Young men!"],
9473=>["Value"=>9473,"TextKey"=>"剧情ID4030116","TextValue"=>"Understood!"],
9474=>["Value"=>9474,"TextKey"=>"剧情ID4040101","TextValue"=>"Look at the highland in the north! There is actually a natural ladder."],
9475=>["Value"=>9475,"TextKey"=>"剧情ID4040102","TextValue"=>"Yes, sir!"],
9476=>["Value"=>9476,"TextKey"=>"剧情ID4040103","TextValue"=>"Have you noticed the column in the middle? That can't be natural. "],
9477=>["Value"=>9477,"TextKey"=>"剧情ID4040104","TextValue"=>"With such a height and shape... I bet on my priest family's reputation that it must be an altar in old days!"],
9478=>["Value"=>9478,"TextKey"=>"剧情ID4040105","TextValue"=>"This altar looks desolate."],
9479=>["Value"=>9479,"TextKey"=>"剧情ID4040106","TextValue"=>"Right, it must be very old."],
9480=>["Value"=>9480,"TextKey"=>"剧情ID4040107","TextValue"=>"Such an altar, incapable of resonating with the power of the Archdruid, could not help us to find Amergin."],
9481=>["Value"=>9481,"TextKey"=>"剧情ID4040108","TextValue"=>"Chief, we need a device that can condense energy…"],
9482=>["Value"=>9482,"TextKey"=>"剧情ID4040109","TextValue"=>"The materials must be able to resist the high temperature here, and the shape must be inward."],
9483=>["Value"=>9483,"TextKey"=>"剧情ID4040110","TextValue"=>"How about those weird fangs near the lava?"],
9484=>["Value"=>9484,"TextKey"=>"剧情ID4040111","TextValue"=>"Not bad, Arlan! No wonder the Goddess's parting prompt said that "always stay close to the important partners"!"],
9485=>["Value"=>9485,"TextKey"=>"剧情ID4040112","TextValue"=>"Certainly! Thank the Goddess!"],
9486=>["Value"=>9486,"TextKey"=>"剧情ID4040113","TextValue"=>"Shut up! You are not included!"],
9487=>["Value"=>9487,"TextKey"=>"剧情ID4040114","TextValue"=>"Let's leave all the materials to our marvelous chief!"],
9488=>["Value"=>9488,"TextKey"=>"剧情ID4050101","TextValue"=>"Chief, we are making so much progress."],
9489=>["Value"=>9489,"TextKey"=>"剧情ID4050102","TextValue"=>"The altar should be fine to use!"],
9490=>["Value"=>9490,"TextKey"=>"剧情ID4050103","TextValue"=>"But look at the gloomy sky! Enda has been struggling going up and down the altar stairs. What if she falls?"],
9491=>["Value"=>9491,"TextKey"=>"剧情ID4050104","TextValue"=>"Not bad, something…stan. Turns out you are not that annoying sometimes."],
9492=>["Value"=>9492,"TextKey"=>"剧情ID4050105","TextValue"=>"After all, Enda is old… Ummm… I mean not young anymore."],
9493=>["Value"=>9493,"TextKey"=>"剧情ID4050106","TextValue"=>"What's in it for you to piss me off?"],
9494=>["Value"=>9494,"TextKey"=>"剧情ID4050107","TextValue"=>"Let's build torches on both sides of the stairs. It's very simple!"],
9495=>["Value"=>9495,"TextKey"=>"剧情ID4060101","TextValue"=>"I feel this altar… still lacks of something, cause it can't sense the Goddess at all…"],
9496=>["Value"=>9496,"TextKey"=>"剧情ID4060102","TextValue"=>"But it should be enough to sense Amergin!"],
9497=>["Value"=>9497,"TextKey"=>"剧情ID4060103","TextValue"=>"It's cold…argh…Who's there?"],
9498=>["Value"=>9498,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Where are you?"],
9499=>["Value"=>9499,"TextKey"=>"剧情ID4060105","TextValue"=>"Are… are you Enda? I have no idea where I am… But it's so cold here…"],
9500=>["Value"=>9500,"TextKey"=>"剧情ID4060106","TextValue"=>"Cold?"],
9501=>["Value"=>9501,"TextKey"=>"剧情ID4060107","TextValue"=>"It seems that he is not here."],
9502=>["Value"=>9502,"TextKey"=>"剧情ID4060108","TextValue"=>"I can't move… Help, $#^*,!@%&:?""],
9503=>["Value"=>9503,"TextKey"=>"剧情ID4060109","TextValue"=>"What did you say?"],
9504=>["Value"=>9504,"TextKey"=>"剧情ID4060110","TextValue"=>"Hey, Enda. I think…"],
9505=>["Value"=>9505,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
9506=>["Value"=>9506,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Hang in there! I have to talk to another person now, it might help you."],
9507=>["Value"=>9507,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, have you seen this situation before?"],
9508=>["Value"=>9508,"TextKey"=>"剧情ID4060114","TextValue"=>"Hey…"],
9509=>["Value"=>9509,"TextKey"=>"剧情ID4060115","TextValue"=>"Spiritual communication isn't really my expertise. But my mother has encountered the same situation. The problem should still be the altar."],
9510=>["Value"=>9510,"TextKey"=>"剧情ID4060116","TextValue"=>"The power of the altar is still too weak. The most important thing is missing."],
9511=>["Value"=>9511,"TextKey"=>"剧情ID4060117","TextValue"=>"The power of the Goddess… @#$>:%^Essence"],
9512=>["Value"=>9512,"TextKey"=>"剧情ID4060118","TextValue"=>"Chief, I think I got it. Look at the vacancy on top of the column of the altar!"],
9513=>["Value"=>9513,"TextKey"=>"剧情ID4060119","TextValue"=>"We need to fill up the Spirit Essence and enhance the power of the altar. Do we have it?"],
9514=>["Value"=>9514,"TextKey"=>"剧情ID4060120","TextValue"=>"What do you say? Arlan, I'll hand it to you right away."],
9515=>["Value"=>9515,"TextKey"=>"剧情ID4060121","TextValue"=>"I got this!"],
9516=>["Value"=>9516,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, say something!"],
9517=>["Value"=>9517,"TextKey"=>"剧情ID4070102","TextValue"=>"You need to come and find me…"],
9518=>["Value"=>9518,"TextKey"=>"剧情ID4070103","TextValue"=>"It should be fine this time. Your voice finally doesn't sound ambiguous as fake-coughing Meg."],
9519=>["Value"=>9519,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg is just an old lady."],
9520=>["Value"=>9520,"TextKey"=>"剧情ID4070105","TextValue"=>"As you said…"],
9521=>["Value"=>9521,"TextKey"=>"剧情ID4070106","TextValue"=>"I had made it to the volcano once, but I had no idea what happened after. When I woke up, I have already ended up here, whatever this hellhole is."],
9522=>["Value"=>9522,"TextKey"=>"剧情ID4070107","TextValue"=>"Although your altar can reach out to me, I guess it couldn't lead you to where I am…"],
9523=>["Value"=>9523,"TextKey"=>"剧情ID4070108","TextValue"=>"Cause despite I can sense and respond to Enda, but this place... definitely will not, and it will manage to hide itself."],
9524=>["Value"=>9524,"TextKey"=>"剧情ID4070109","TextValue"=>"Any ideas?"],
9525=>["Value"=>9525,"TextKey"=>"剧情ID4070110","TextValue"=>"Coexist with the environment…endlessly…and form a circulation."],
9526=>["Value"=>9526,"TextKey"=>"剧情ID4070111","TextValue"=>"What do you mean? Let the flames here flow to the ice cellar you are in?"],
9527=>["Value"=>9527,"TextKey"=>"剧情ID4070112","TextValue"=>"You fat-headed student! Of course not."],
9528=>["Value"=>9528,"TextKey"=>"剧情ID4070113","TextValue"=>"Circulation… Let the lava flow to create ashes, let the ashes rise and solidify to rocks, and finally let the rocks erupt to lava again."],
9529=>["Value"=>9529,"TextKey"=>"剧情ID4070114","TextValue"=>"You are indeed a top student."],
9530=>["Value"=>9530,"TextKey"=>"剧情ID4070115","TextValue"=>"Wait!"],
9531=>["Value"=>9531,"TextKey"=>"剧情ID4080101","TextValue"=>"Is this… a pig's head?"],
9532=>["Value"=>9532,"TextKey"=>"剧情ID4080102","TextValue"=>"Uh-huh."],
9533=>["Value"=>9533,"TextKey"=>"剧情ID4080103","TextValue"=>"With all due respect, why is it shaped like a pig's head?"],
9534=>["Value"=>9534,"TextKey"=>"剧情ID4080104","TextValue"=>"Wait, I shouldn't be asking this question."],
9535=>["Value"=>9535,"TextKey"=>"剧情ID4080105","TextValue"=>"Goddess! Dearest partners are needed on the road to success. Why don't we leave my partner, something-stan's figure here!"],
9536=>["Value"=>9536,"TextKey"=>"剧情ID4080106","TextValue"=>"Look how cute our priest is! Look at such a subtle way of being nice. "],
9537=>["Value"=>9537,"TextKey"=>"剧情ID4080107","TextValue"=>"You!"],
9538=>["Value"=>9538,"TextKey"=>"剧情ID4080108","TextValue"=>"Get out of the way, the chief and I are about to start the altar."],
9539=>["Value"=>9539,"TextKey"=>"剧情ID4090101","TextValue"=>"Sigh... Enda, showtime."],
9540=>["Value"=>9540,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin is in…"],
9541=>["Value"=>9541,"TextKey"=>"剧情ID4090103","TextValue"=>"The Far East… A place where is frosty and forbidden."],
9542=>["Value"=>9542,"TextKey"=>"剧情ID4090104","TextValue"=>"Although it is steaming hot here, I think we should start to prepare winter clothes."],
